--
-- Estrutura da tabela `marco2`
--

DROP TABLE IF EXISTS `marco2`;
CREATE TABLE IF NOT EXISTS `marco2` (
  `product_id` int(11) NOT NULL AUTO_INCREMENT,
  `language_id` int(11) NOT NULL DEFAULT '1',
  `name` varchar(64) COLLATE latin1_general_ci NOT NULL DEFAULT '',
  `description` text COLLATE latin1_general_ci,
  PRIMARY KEY (`product_id`,`language_id`),
  KEY `products_name` (`name`)
) ENGINE=MyISAM  DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci AUTO_INCREMENT=162 ;

--
-- Extraindo dados da tabela `marco2`
--

INSERT DELAYED IGNORE INTO `marco2` (`product_id`, `language_id`, `name`, `description`) VALUES
(1, 2, 'Chocalho gruda-gruda', 'Brinquedo composto por dois potes cilíndricos, medindo 10 cm de altura e 7 de diâmetro, forrados com tecidos diferentes na cor e na textura. Os chocalhos contêm em seu interior objetos diferentes, assim produzem sons diferentes. Ambos possuem, no sentido vertical, uma faixa de velcro que prende um ao outro.'),
(2, 2, 'Ao pé do ouvido', 'Painel feito de tecido macio, acolchoado, colorido, medindo 100 x 80 cm.\r\nNo painel há dez pequenas argolas onde estão     presos elásticos de 15 cm.\r\nNa ponta dos elásticos estão amarrados brinquedos sonoros: pandeiro, corneta, chocalho, apito, gaita, sanfona, etc.'),
(3, 2, 'Chocalho ouro-prata', 'Brinquedo composto por dois potes cilíndricos medindo 10 cm de altura e 7 de diâmetro, forrados com tecidos de cores fortes, dourado e prateado, com texturas diferentes. O chocalho prateado, forrado com tecido de textura bem lisa, traz dentro algumas pedras e é bem pesado. O chocalho dourado, forrado com tecido de textura áspera, possui dentro algumas moedas e é mais leve.'),
(4, 2, 'Pulseirinha', 'Duas pulseiras feitas de contas redondas, de várias cores, enfiadas em um elástico redondo fino, intercaladas com quatro guizos.'),
(5, 2, 'Guizo pé-mão', 'Duas pulseiras de tecido vermelho com guizos e duas tornozeleiras de tecido azul também com guizos.'),
(6, 2, 'Chocalho sensorial', 'Chocalho de forma cilíndrica medindo 10 cm de altura e 7 de diâmetro, forrado com tecido em cores de alto contraste, preto e branco, contendo em seu interior objetos que produzem som como, por exemplo, arroz.'),
(7, 2, 'Capa de mamadeira', 'Capa de crochê com listras alternadas em preto e branco.'),
(129, 2, 'Manual Braille', 'A máquina de escrever Braille é o mais eficiente instrumento de educação para a pessoa cega. Este manual ilustrado mostra de maneira muito simples, como utilizar a máquina para escrever neste sistema. <br> Autoras:<br> <i><b> Cecília Oka e <br> Wilma Pires de Miranda<br> </b> </i> 48 páginas'),
(8, 2, 'Meia careta', 'Meia de tamanho pequeno, vermelha, tendo na ponta um pompom amarelo. Na parte correspondente à planta do pé, estão presos 3 guizos, colocados a alguma distância um do outro.'),
(128, 2, 'Dama e Trilha', '<b>Dama</b><br>\r\nTabuleiro de dama em madeira (modelo padrão), com velcro (macho) colado nos quadrados pretos. Contém 24 peças em EVA com texturas (12 com lixa e 12 lisas) e 12 damas (peças duplas coladas, sendo 6 com lixa e 6 lisas). Todas as peças possuem velcro (fêmea) colado na parte de baixo para que sejam fixadas no tabuleiro.<br>\r\n<b>Trilha</b><br>\r\nTabuleiro de trilha em madeira (modelo padrão), com 24 pontos circulares nos quais são colados velcro (macho) e um ponto é ligado ao outro por tiras de lixa coladas. Contém 18 peças (9 com feltro e 9 lisas), com velcro (fêmea) colado na parte de baixo para que sejam fixadas no tabuleiro.'),
(9, 2, 'Sexteto em cores', 'Painel de papelão, medindo 50x40 cm. No painel estão colados 6 quadrados de papelão de 15x15 cm com figuras coloridas e atraentes: carro, bola, maçã, cara, casa e barco. As figuras estão coladas em duas linhas horizontais de 3 figuras cada uma. Todo o conjunto é plastificado. Acompanham mais 6 quadrados com a mesma medida e as mesmas figuras do painel, plastificados e colocados em um envelope.'),
(10, 2, 'Multiquadros', 'Painel feito em tecido macio, acolchoado, medindo 64 x 82 cm, composto de nove retângulos de cores vivas medindo 17 x 20 cm.\r\nCada retângulo tem uma atraente e interessante figura de animal, brinquedo ou objeto.\r\nAlguns dos retângulos possuem partes removíveis ou sonoras: um peixinho que pode ser retirado do aquário, as rodas de um carro que giram, a tv com botões que podem ser rodados, o relevo encontrado na casca do abacaxi, uma bola que produz som quando apertada, uma ave com asas soltas, uma tartaruga presa com velcro.'),
(127, 2, 'Batalha naval', 'Batalha naval\r\nDois tabuleiros de EVA nas cores vermelha e amarela, medindo 32 x 32 cm com recorte em ângulo do lado direito superior, formados cada um por 5 colunas com 8 quadrados (o primeiro vazio e do segundo ao oitavo com as letras de A à G, respectivamente, ampliadas e em braille) de 4,2 cm cada, e outras 4 colunas em formato retangular medindo 6,2 cm (do primeiro ao quarto numerados de 1 a 4, respectivamente), divididos por tiras de EVA de 0,5 cm de espessura. Contêm 8 barcos em miniatura.'),
(11, 2, 'Cubos de alto contraste', 'Cubos feitos de espuma, revestidos de tecidos em padrões de alto contraste, preto e branco, medindo 12 cm de lado.\r\nSão três cubos sendo um deles de listras, o outro xadrez e o último de bolas.\r\nOs cubos possuem nas laterais faixas de velcro que prendem um ao outro.\r\nNo interior do cubo existe um guizo que produz som quando ele é movimentado.'),
(126, 2, 'Jogo da velha', 'Tabuleiro feito de EVA nas cores preto e vermelho, medindo 32 x 32 cm, com recorte em ângulo do lado direito superior. Possui 3 colunas com 3 quadrados em cada uma, medindo 10,2 cm divididos por tiras de 0,5 cm de espessura. Contém 5 círculos de EVA amarelos de 8 cm de diâmetro e 5 peças vermelhas no formato de X, medindo 7 x 7 cm.'),
(12, 2, 'Painel de cores e formas', 'Painel feito em tecido macio, acolchoado, medindo 100 x 80 cm, composto por 20 quadrados de 20 cm, nas cores vermelha, amarela, azul, e verde.\r\nNo centro de cada quadrado está preso um objeto, letra ou número e de cada tipo existem 2 objetos iguais em uso e função,  mas de tamanho e cor diferentes e feitos de diferentes materiais. Os objetos iguais estão colocados em quadrados de mesma cor.'),
(13, 2, 'Trio em preto e branco', 'Kit contendo três almofadas, recheadas de material leve e macio, medindo cada uma 25 x 35 cm.\r\nRevestidas em tecido de algodão, em padrões de alto contraste, preto e branco, sendo uma listrada, a outra xadrez e a última de bolas.'),
(14, 2, 'Luva Fantoche', 'Luva confeccionada em tecido brilhante ou de cor viva com uma careta desenhada na palma da mão.'),
(15, 2, 'Portátil', 'Sacola feita de tecido macio, acolchoado, medindo 50  x 50 cm (quando aberta 100 x 50 cm) tendo estampados na face externa 8 quadrados: 2 vermelhos, 2 azuis, 2 amarelos e 2 verdes.\r\nNa face interna da sacola temos, em uma metade, um tabuleiro de damas e, na outra, um jogo da velha.\r\nAcompanha uma sacola com pedras de dama e jogo da velha (para serem usadas na face interna) e formas geométricas (para serem colocadas sobre as figuras estampadas na  face externa da sacola).\r\nA sacola é fechada nas laterais por botões e, quando aberta, transforma-se em um tapetinho.'),
(16, 2, 'Formcolor', 'Brinquedo composto por prancheta preta retangular, de material leve e macio, com 27 x 22 cm, tendo em uma das faces 20 orifícios nas 4 formas geométricas principais: quadrado, círculo, retângulo e triângulo. A prancheta tem textura lisa.\r\nAcompanham 20 plaquinhas de textura granulosa, com as mesmas formas geométricas,  em cores fortes e diferentes: amarelo, azul, verde e vermelho.'),
(17, 2, 'Casal legal - Léo e Lu', 'Bonequinhos revestidos de pluma branca, leves e agradáveis ao tato, representando uma menina e um menino.\r\nA boneca está com vestido amarelo, fechado com velcro nas costas e avental de tecido xadrez preto e branco. Nos pés, dois laços de fita amarela.\r\nO boneco está vestido com macacão amarelo tendo na frente um bolso xadrez preto e branco. Sob o macacão, uma camisa do mesmo tecido xadrez preto e branco, abotoada nas costas com velcro.'),
(18, 2, 'Ciranda das cores', 'Painel circular, feito de tecido macio, acolchoado, alegre e colorido, com 80 cm de diâmetro.\r\nPossui em toda a volta 12 bolsos nas seguintes cores: amarelo, azul, verde e vermelho, intercaladas. Em cada  bolso há  um objeto de uso comum da criança ou brinquedo sobre o qual ela possa agir: pentear, cortar, dar corda, apertar; um deles é sonoro. A figura de cada brinquedo está estampada na frente do respectivo bolso.\r\nO painel possui duas alças e, quando dobrado, vira uma bolsa.'),
(19, 2, 'Tapete de alto contraste', 'Tapetinho feito em tecido macio e acolchoado, com desenhos e formas em cores contrastantes, branco e preto, com  listas, círculos, xadrez, bolas etc.\r\nFormas em relevo são encontradas no tapete.'),
(20, 2, 'Bicharada', 'Painel feito de papelão plastificado, medindo 55 x 25 cm.\r\nEm uma das faces do painel existem duas fileiras horizontais, com silhuetas negras \r\nanimais: porco, pato, macaco, galo, coelho, cavalo, rato, gato,  cachorro e vaca.\r\nNa face oposta, está o contorno das mesmas figuras.\r\nEnvelope com dez retângulos transparentes de 10 x 10 cm com o contorno das figuras.'),
(21, 2, 'Amassadinha', 'Brinquedo composto de uma pequena bexiga de borracha colorida, recheada de farinha de trigo, formando uma bola. Esta bola é muito flexível e, ao ser apertada, muda totalmente de forma. Em uma das faces da bola estão colocados elementos que imitam olhos, nariz e boca. Na parte superior fios de lã imitam os cabelos, amarelos ou pretos, mais longos ou mais curtos.'),
(22, 2, 'Rodão', 'Material composto de uma câmara-de-ar cheia, medindo 140 cm de diâmetro, revestida de tecido de tricô, de 4 cores: vermelho, azul, amarelo e verde.\r\nNa parte de cima do rodão estão presos, com elástico de 15 cm de comprimento, diferentes objetos e brinquedos: bola, escova de cabelo, caneca, esponja de banho, sanfona, pandeiro, corneta, embalagem de desodorante e bolsa com zíper. Os elásticos podem ser colocados  e retirados com facilidade, para que os objetos não sejam usados todos ao mesmo tempo.\r\nUm pequeno travesseiro serve de encosto para a criança.'),
(23, 2, 'Bola baby', 'Bola pequena, macia e agradável ao tato, cujo revestimento é feito de quatro tecidos diferentes na cor e na textura: vermelho, branco, com listas pretas e brancas e, o último preto, com bolas brancas.\r\nNo interior da bolinha existe um guizo.'),
(125, 2, 'Papai e Mamãe, Vamos Brincar', 'A confecção e uso de brinquedos como proposta de interação entre pais e filhos.\r\n<br><br>\r\nAutora:<br>\r\n<i>\r\n<b>\r\nMara O. de Campos Siaulys<br>\r\n</b>\r\n</i>\r\n<br>\r\n70 Páginas.'),
(24, 2, 'Dentro d''agua', 'Brinquedo composto de uma prancheta de 44,5 x 12 cm feita de material leve e macio, tendo uma face azul e outra amarela. Na face azul existem quatro cavidades onde se encaixam 4 peixes amarelos com textura diferente daquela da prancheta, todos de forma exatamente igual mas de tamanhos variados. Os peixes, quando encaixados, ficam em relevo.'),
(25, 2, 'Parabólicos', 'Brinquedo composto de dois macacões feitos de tecido pluma, leve e macio, em duas cores diferentes, bem vivas, com algumas aplicações de cor branca, com bastante contraste.\r\nAcompanham duas bolas pretas revestidas de velcro.'),
(26, 2, 'Cole-ball', 'Brinquedo composto de dois coletes feitos de tecido de nylon, um preto e outro azul.\r\nNa parte das costas encontramos faixas de velcro coloridas.\r\nNa frente temos figuras de cinco frutas diferentes.\r\nAcompanham duas bolas brancas, recobertas de tecido pluma.'),
(27, 2, 'Doce sabor', 'Brinquedo composto de uma caixa de plástico medindo 35x19 cm.\r\nUm pedaço de doce (gelatina) colorido medindo.<br>\r\nUm bastão de pirulito de 15 cm de comprimento para ser colocado no centro do doce.<br>\r\n24 balas de forma circular com um furo central, de cores variadas.<br>\r\n1 tubo de pastilhas de menta de cor branca, de forma circular, com um furo central.<br>\r\n1 metro de fio de nylon.<br>\r\n2 caixas de gelatina em pó de sabores diferentes.<br>\r\n3 envelopes de ksuco de sabores diferentes.<br>\r\n1 pacotinho de bolacha redonda com furo central.<br>\r\n1 pacotinho de farinha de trigo.<br>\r\n1 receita de tinta de gelatina.<br>\r\n1 receita de massinha colorida.<br>'),
(28, 2, 'Rolinho', 'Rolo feito de tecido atoalhado ou de uma toalha de banho enrolada, com aproximadamente 14 cm de diâmetro e 50 de comprimento. Este rolo é acolchoado com espuma e revestido de tecido colorido, arrematado nas duas pontas por laços de fitas coloridas nos quais se prende um guizo.'),
(29, 2, 'Cubo geométrico', 'Cubo feito de espuma, medindo 10  x 10 cm, leve e revestido de tecido macio. \r\nEm cada lado existe uma aplicação de velcro onde se prende uma figura geométrica bidimensional feita em feltro colorido; são 3 pares de figuras diferentes.\r\nNo interior do cubo existe um guizo que produz som.'),
(30, 2, 'Frutíferas', 'Uma prancheta de madeira de 37 x 26 cm, revestida na parte superior com material emborrachado, leve e macio, de cor amarela. No material emborrachado há três cavidades onde se encaixam três figuras de árvores, de formas iguais, mas de tamanhos diferentes. Nas figuras estão recortados pequenos círculos de cor laranja, com textura diferente da árvore: cinco círculos na árvore maior, quatro na média e três na pequena; os círculos imitam frutas e têm tamanhos variados, de acordo com a árvore onde ficam. As árvores, quando encaixadas, ficam em relevo.'),
(31, 2, 'Toninho', 'Brinquedo composto de uma placa de material emborrachado, leve e macio, medindo 27 x 22 cm. Em sua superfície existe uma cavidade onde se encaixa a figura de um menino. A figura é composta de partes separadas: pernas, braços, corpo e cabeça, de cores diferentes.'),
(32, 2, 'Móbile bolinha', 'Bastidor com diâmetro de 15 cm, pintado de amarelo.\r\nNo bastidor existem 4 furos onde passam barbantes de mais de mais ou menos 40 cm. Na ponta de cada barbante está presa uma bola com guizo em cores variadas, os barbantes se unem na parte superior. Na ponta de união dos quatro barbantes está preso um 5º barbante com bola na ponta.'),
(33, 2, 'Cocos decorados', 'Brinquedo composto de duas metades da casca de um coco, decoradas na parte externa com papéis coloridos.\r\nA parte interna é forrada com espuma para aumentar a espessura e ficar macia.\r\nOs dois lados da borda são furados para que se passe um cordão por eles.\r\nDois cordões de 15 cm para prender o brinquedo no braço da criança.'),
(34, 2, 'Body-ball', 'Brinquedo composto por um painel de madeira, de cor branca, medindo 85 cm de altura e 62 de largura.\r\nSobre o painel está colado a figura de uma menina ou um menino com a mesma altura do painel.\r\nA figura de tecido pluma, têm roupas de cores fortes, sapatos e meias, tudo feito com o mesmo tecido.\r\nOs bonecos possuem cabelos sendo o da menina destacado do painel e amarrado com fita.\r\nAcompanha uma bolinha de cor preta com elementos de velcro que facilitam a aderência ao tecido de pluma dos bonecos.'),
(35, 2, 'Formatando', 'Brinquedo composto de uma prancheta retangular, medindo 46,5 x 25 cm, de cor branca, feita de material leve e macio, onde se encontram 4 cavidades em forma das 4 figuras geométricas: quadrado, círculo, triângulo e retângulo. Acompanham 4 placas com as mesmas formas geométricas, que se encaixam nas cavidades, e ficam um pouco mais altas do que a superfície da prancheta.'),
(36, 2, 'Forme formas', 'Material composto de 6 placas retangulares medindo 26 x 20 cm, feitas de material leve e macio, de cor azul. Cada placa contém orifícios que formam uma figura geométrica: círculo, quadrado, retângulo, triângulo, estrela e oval; Acompanham 80 pinos que, encaixados, formam a figura em relevo.'),
(37, 2, 'Livro das grandezas', 'Livro feito em tecido macio, feltro colorido, medindo 30 x 25 cm, possuindo 10 folhas incluindo a capa, presas com um laço de fita.\r\nCada folha contém elementos concretos, bidimensionais, que mostram formas e grandezas diferentes: comprimento, largura, altura e grossura.\r\nContém zíperes  e laço de fita que ajudam no aprendizado das atividades de vida diária e desenvolvem a coordenação motora.'),
(38, 2, 'Gira-gira', 'Brinquedo composto de duas placas circulares, sobrepostas, feitas de material leve e macio, medindo 49,5 cm de diâmetro, de cor amarela, uma girando sobre a outra.\r\nAcompanha um recipiente redondo com tampa, cheio de peças recortadas nas mesmas formas das cavidades, com texturas, tamanhos e cores variadas, sendo algumas vazadas.'),
(39, 2, 'Forma e números', 'Material composto de uma prancheta retangular de material leve e macio, de cor branca, medindo 47,5 x 28 cm. Sobre a prancheta encontram-se 9 pinos de 12 cm dispostos em 3 carreiras horizontais. Próximo de cada pino temos um número de 1 a 9 em braille e em tinta; Acompanham 45 peças, com um furo central, de nove formas diferentes: oval, retângulo, hexágono, quadrado, círculo, estrela, coração, losango e triângulo.'),
(40, 2, 'Prancheta geométrica', 'Prancheta feita de material leve e macio, de forma retangular, medindo 80 x 25 cm, de cor preta.\r\nQuatro caixas de cores diferentes de aproximadamente 15 cm, nas formas de : círculo, retângulo , triângulo , quadrado \r\nAcompanha um recipiente redondo com tampa, cheio de placas recortadas nas mesmas quatro formas geométricas, em diferentes cores e texturas, sendo algumas vazadas.'),
(41, 2, 'Cubo surpresa', 'Material composto por seis placas quadradas, com 32 cm de lado, feitas de material de cores variadas. As placas se encaixam formando um cubo. Em duas placas existem aberturas redondas onde a criança pode introduzir as mãos. No interior do cubo existem 10 círculos, formando 5 pares de círculos com diferentes texturas.'),
(42, 2, 'Encaixando', 'Material composto por 7 potes cilíndricos, com 24 cm de altura, tampados, cada um contendo pequenos objetos diferentes entre si, ex: bolinhas de gude, apitos, pião, chaves, pedras, pilhas pequenas, tampinhas de garrafa, conchas e botões. Os potes são revestidos por diferentes materiais: feltro, cortiça, papel ondulado, plástico com bolinhas, emborrachado, soft e lixa. Outros 7 potes cilíndricos, bem mais baixos e com um diâmetro maior que os anteriores, com 13 cm de altura, sem tampa, revestidos com os mesmos materiais citados anteriormente.'),
(43, 2, 'Tampadinhas', 'Painel feito de tecido de nylon azul, acolchoado, medindo 100 cm de comprimento por 50 de largura.\r\nO painel tem alças nos lados mais estreitos, transformando-se em uma sacola fechada por velcro nas laterais.\r\nTraz um gancho em forma de cabide por onde será  pendurado.\r\nEncontram-se no painel pequenos envelopes de plástico onde serão encaixados cartões com os nomes dos meses do ano, dias da semana e dias do mês. \r\nEm outros envelopes situados  ao lado dos anteriores serão encaixados cartões com nomes de datas festivas  ou datas importantes para a criança. \r\nOutros envelopes permitem que  a criança coloque cartões referentes a  atividades que ela desenvolve nos diferentes dias de semana. \r\nTodos os cartões são escritos em braille e em letra comum. \r\nNa parte superior está o título: meses do ano, dias da semana e, na parte inferior, dias do mês.\r\nMaterial muito útil para ajudar a criança na organização temporal e na organização de suas atividades nos vários dias da semana.'),
(44, 2, 'Dominó de texturas', 'Caixa contendo 28 retângulos de material emborrachado preto com 5x2,5 cm. Cada retângulo possui nas duas pontas um pequeno círculo de cor e textura diferente.'),
(45, 2, 'Fofão', 'Puf redondo, recoberto por faixas de tecido colorido sendo: vermelho nas laterais, amarelo e azul na frente, a parte posterior e o assento de couro branco. Todos os tecidos têm textura diferente.\r\nNa parte da frente existem dois bolsos de plástico transparente em que estão escritas  as palavras direito e esquerdo em braille e letra comum. Os bolsos contêm um par de chinelos.\r\nNas laterais encontram-se bolsos plásticos com vários brinquedos.\r\nAinda nas laterais, sobre os bolsos, encontramos duas alças nas quais a criança pode segurar e se apoiar.\r\nO puf possui uma ponta superior na qual está pregada uma borla de lã verde. \r\nQuando a criança senta-se sobre o puf ela forma um encosto.'),
(46, 2, 'Text form', 'Material composto de placa feita de material leve e macio, de cor verde, medindo 36 x 27 cm, com 9 pinos dispostos em 3 fileiras horizontais. Acompanham 18 peças do mesmo material, recortadas em forma hexagonal, com um furo no meio. Um dos lados de cada peça é recoberto por material de texturas e cores variadas, formando 9 pares de texturas diferentes.'),
(47, 2, 'Eu e o papai', 'Material composto de duas almofadas de tamanhos, cores e texturas diferentes.\r\nEm uma das faces da almofada maior encontra-se um envelope de plástico transparente onde deve ser encaixada a foto do papai.\r\nNa almofada menor também encontra-se um envelope igual onde deve ser encaixada a foto do bebê.\r\nNo interior das almofadas temos substâncias aromáticas com aroma diferente em cada uma.'),
(48, 2, 'Rebola Bola', 'Material composto de uma caixa de madeira retangular azul, medindo 80 cm de comprimento, 40 de largura e 12,5 de altura, dividida em 18 compartimentos iguais, dispostos em 3 fileiras horizontais de 6 compartimentos cada.\r\nAcompanham 18 pares de bolas, de diferentes cores, materiais, peso, textura, temperatura, consistência, sendo sonoras ou não.'),
(49, 2, 'Imitando a mamãe', 'Conjunto com 5 necessaire, cada uma de tamanho diferente. Dentro de cada bolsa encontra-se objetos utilizados pela Mamãe em seu dia-a-dia. Ex: molho de chaves, caderneta, batom, caneta, espelho, pente...'),
(50, 2, 'Sacoleca', 'Brinquedo composto de prancheta feita de material leve e macio, medindo 40 x 40 cm na cor preta.\r\nAcompanham quatro potes de plástico tampados nas cores: amarelo, vermelho, azul e verde.\r\nRecipiente redondo de plástico, contendo objetos de  4 tipos diferentes: conchas, moedas, pedras e bolas de gude.'),
(51, 2, 'Separando', 'Brinquedo composto de prancheta feita de material leve e macio, medindo 40 x 40 cm na cor preta. Acompanham quatro potes de plástico tampados, nas cores: amarelo, vermelho, azul e verde. Recipiente redondo de plástico, contendo objetos de 4 tipos diferentes: conchas, moedas, pedras e bolas de gude.'),
(52, 2, 'Sacola de piscina', ''),
(53, 2, 'Tateando', 'Tapete confeccionado em tecido colorido, macio, acolchoado, retangular, medindo 130 x 90 cm. Nele estão presos, com elástico de 15 cm de comprimento, diferentes objetos e brinquedos: argola, pente, peteca, bolsinha com zíper contendo óculos, caneca, escova de cabelo, esponja de banho, tubo de desodorante, ursinho de pelúcia . O elástico facilita à criança recuperar com facilidade os objetos.'),
(54, 2, 'Um, dois... feijão com arroz', 'Brinquedo feito de material leve e macio, amarelo, reproduzindo as mãos direita e esquerda.\r\nNa ponta  dos dedos da mão esquerda estão os números de 1 a 5  iniciando no dedo mínimo. Na mão direita estão os números de 6 a 10 iniciando pelo polegar.\r\nOs números estão escritos em braille e em tinta.'),
(55, 2, 'Trincos e truques', 'Prancha de madeira, retangular, medindo 30 x 21 cm.\r\nNa superfície da prancha encontram-se 5 portas, com dobradiças, cada uma delas com fechos diferentes: 3 tipos de trinco, chave, cadeado. Uma das portas tem puxador.\r\nEncontramos ainda uma trava de segurança para porta.\r\nAcompanha uma sacola com 7 réplicas de ferramentas, feitas de plástico e 4 parafusos plásticos.\r\nFaz parte também uma placa de encartex onde podem ser encaixados parafusos verdadeiros em tamanhos variados.'),
(56, 2, 'Pareando objetos', 'Material composto de uma caixa de madeira amarela, retangular, medindo 80 cm de comprimento, 40 de largura e 12,5 de altura dividida em 18 compartimentos iguais, dispostos em 3 fileiras horizontais de 6 compartimentos cada.\r\nAcompanham 18 tipos diferentes  de objetos. Colocamos 2 ou 3 objetos de cada tipo, feitos com material diferente, tendo tamanhos diferentes, porém com o mesmo uso e função.\r\nOs objetos são acomodados em um recipiente redondo.'),
(57, 2, 'Kit de higiene', 'Material composto de uma prancheta feita de material leve e agradável ao tato, com 15 X 13 cm, tendo uma superfície rebaixada onde se encaixa uma plaqueta com o nome de um objeto. Acompanham quatro plaquetas, cada uma com o nome de um objeto diferente escrito em braille. Um pequeno corte identifica o canto superior direito. Fazem parte do kit quatro objetos cujos nomes estão colocados nas plaquetas e que são familiares à criança por pertencerem às suas atividades diárias de higiene.'),
(58, 2, 'Feirinha', 'Sacola de nylon, medindo 34 x 38 cm, própria para fazer compras na feira. Em seu interior encontram-se réplicas feitas de plástico de frutas e legumes, sendo 18 frutas e 10 legumes.'),
(59, 2, 'Pré bengala', 'Brinquedo em forma de raquete, confeccionado a partir de um bambolê que é dobrado, amarrado e preso com fita adesiva, formando um cabo.\r\nDeve ter cor forte e alegre: vermelha, amarela.\r\nNo interior do tubo colocam-se bolas ou objetos que produzem som.'),
(60, 2, 'Como gente grande', 'Brinquedo composto de um tapete acolchoado de cor amarela, arrematado em volta em cor vermelha, medindo 50 x 100 cm,  com duas alças que o transformam em uma sacola. \r\nNo interior existem dezoito bolsos de plástico, nove em cada metade da sacola.\r\nUma sacola suplementar com as mesmas características, medindo 45 x 50 cm contém dezoito objetos, sendo nove de cozinha e nove de banheiro, em sua forma e tamanho reais: peneira, funil, palha de aço, esponja, espremedor de laranja, garfo, pasta de dente, escova de cabelo, pente, bucha para banho, talco, desodorante.'),
(61, 2, 'Brincando de mamãe', 'Painel de tecido macio, acolchoado e agradável ao tato, medindo 100 x 80 cm. Na superfície do painel, estão presos elementos que incentivam as brincadeiras e despertam a curiosidade das crianças, ajudando-as no aprendizado das atividades de higiene, alimentação e vestuário. Na parte superior do painel, encontram-se dois bonequinhos de pano, que representam um menino e uma menina. Eles podem ser removidos do painel e sua roupa pode ser retirada. Brincando com os bonecos, as crianças podem realizar atividades como: dar laço, fechar e abrir fivela, fechar com velcro, abotoar etc. Entre os dois bonecos há um envelope de plástico contendo um prato, uma colher e uma caneca. Na parte inferior existem três bolsos onde estão colocados objetos usados na higiene: esponja, sabonete, pasta de dente, talco, xampu, desodorante, pente, escova de dente e de cabelo e toalha.'),
(62, 2, 'Pra boiar', 'Placas recortadas em material leve e agradável ao tato, nas formas de caranguejo e estrela do mar, medindo aproximadamente 20 cm, sendo uma amarela e outra azul. No centro de cada placa existe um orifício onde pode ser encaixado um copo. O material usado permite que as placas bóiem na água.'),
(63, 2, 'Bolsões', 'Avental confeccionado em tecido amarelo, tendo na frente dois bolsos nas cores azul e vermelha.\r\nOs bolsos contêm objetos que são utilizados na higiene: sabonete, esponja, toalha, pente, escova de cabelo, talco, desodorante, pasta e escova de dente.'),
(64, 2, 'Prancha de alimentação', 'Prancha retangular, feita de material leve, macio e agradável ao tato, medindo 42 x 34 cm. A prancha é preta, lisa e os elementos que representam o prato, o copo e os talheres são amarelos, recortados e feitos de material com textura granulosa; as figuras recortadas do prato, copo e talheres poderão ser removidas e facilmente recolocadas. A textura e a cor desses elementos destacáveis são diferentes e contrastam bastante com a prancheta.'),
(124, 2, 'Livro sensorial - vol. 01 e 02', 'Livro composto de sessenta páginas, em dois volumes, medindo 36 x 22 cm, com duzentas e quatro figuras em relevo. As figuras são feitas de materiais bem variados: espuma, tecido, madeira, plástico, barbante, material emborrachado e outros. As figuras são coloridas e o livro é atraente também para as crianças que enxergam. O livro possui um kit com figuras recortadas que possibilita à criança representar cenas que ilustrem histórias por ela criadas, aplicando os conhecimentos adquiridos. A última folha do livro é uma tela de nylon que permite à criança fazer representações gráficas em relevo, bastando para isso usar uma folha de papel sobre a tela e uma caneta sem ponta.'),
(65, 2, 'Guarda Trecos', 'Pote redondo medindo 53 cm de altura e 14 cm de diâmetro.\r\nForrado em tecido de cor forte tendo na parte externa aplicações de atraentes figuras feitas de feltro, bem coloridas, representando cenas, como por exemplo o circo, o mar, etc.'),
(66, 2, 'Bengala infantil', 'O preço da bengala dobrável com ponteira fixa de 0,70cm até 0,95cm ? R$ 38,00 no estado de São Paulo\r\n\r\n* Bengala dobrável\r\n* Alumínio leve\r\n* Cabo de borracha e anatômico (macio e de fácil manuseio)\r\n* Pintura eletrostática (reflete a luz)\r\n* Ponteira fixa ou roller de nylon 6.0 / diâmetro 20mm (maior durabilidade)\r\n* Elástico revestido c/ nylon ? 04 voltas (maior resistência)\r\n* Tamanhos diversos'),
(67, 2, 'Alphaímã', 'Placa retangular imantada medindo 12 x 8cm\r\nAcompanham 6 botões coloridos, imantados, de forma circular                  \r\nAcompanha o alfabeto braille.'),
(68, 2, 'Pro banho', 'Peixe feito de material leve e agradável ao tato, nas cores laranja e amarelo, medindo 20 cm de comprimento. Na parte mais larga possui furos e nas laterais existem bordas que permitem a colocação de um sabonete. O material usado permite que o peixe bóie na água.'),
(69, 2, 'Gaveteiro alfabético', 'Estante retangular de plástico medindo 91 cm de largura, 34 de altura e 12 de profundidade.\r\nComposta de 24 gavetas dispostas em 6 fileiras horizontais de 4 gavetas.\r\nOs objetos são simples, pertencentes ao dia-a-dia da criança, de material e uso variados.\r\nAcompanha o alfabeto braille.'),
(80, 2, 'Braillex', 'Prancheta de madeira perfurada, medindo 40x18 cm, com furos agrupados de 6 em 6, reproduzindo as celas braille.\r\nAcompanha uma  caixa com 72 pinos metálicos sem ponta.\r\nAcompanha o alfabeto braille.'),
(72, 2, 'Pote surpresa', 'Pote de plástico redondo com tampa, medindo 27 cm de diâmetro e 14 de altura.\r\nNa tampa do pote está colado um retângulo de 8x14 cm com 6 orifícios representando a cela braille. Um pequeno corte identifica o canto superior direito do retângulo. Acompanham seis pequenos círculos que podem ser encaixados nos orifícios e servem para formar uma letra em braille.\r\nNo interior do pote encontram-se 23 objetos diferentes, feitos de materiais variados, cujos nomes iniciam por uma das 23 letras do alfabeto.\r\nOs objetos são simples, de uso variado, pertencentes ao dia-a-dia da criança.\r\nAcompanha o alfabeto braille.'),
(78, 2, 'Brailindo', 'Brinquedo composto de uma régua feita de material leve e macio, medindo 25 x 5 cm. Acompanham 32 pinos coloridos. Acompanha alfabeto braille.'),
(79, 2, 'Pro Pé', 'Chinelo feito de material leve, macio e colorido, com a cara de um bichinho. Apresentação em 3 tamanhos: pequeno, médio e grande.'),
(76, 2, 'Larabraille', 'Brinquedo composto de uma prancheta de madeira medindo 22 x 9 cm, com pequenos furos agrupados de 6 em 6, reproduzindo a cela braille.\r\nAcompanham  102 pequenos pinos metálicos sem ponta.\r\nAcompanha o alfabeto braille.'),
(77, 2, 'Tato e Tati', 'Bonequinhos representando uma menina e um menino, ela de cabelo comprido e loiro, ele de cabelo curto e escuro, vestidos de macacão azul e amarelo.\r\nO macacão possui bolso, botão, cinto com fivela e abotoamento com velcro nas costas.\r\nO sapato é amarrado com cadarço e laço.'),
(75, 2, 'Ao pé da letra', 'Painel retangular, feito de material emborrachado leve e macio, de cor azul, medindo 100 x 60 cm. Cada bolso é identificado por uma letra em braille e em tinta e contém pequenos objetos cujo nome inicia com essa letra. Os objetos são simples, pertencentes ao dia-a-dia da criança, feitos de material variado. Acompanha o alfabeto braille.'),
(81, 2, 'Brailito', 'Brinquedo confeccionado em material leve e macio, composto de 47 retângulos medindo 3 x 2 cm cada um. Cada retângulo representa uma cela braille e nele estão inseridos pinos metálicos formando as letras do alfabeto, em braille, as vogais acentuadas e duplicatas das vogais e consoantes de uso mais freqüente. No lado de dentro da tampa existe um espaço onde poderão ser acomodados os retângulos com as letras em braille para formar palavras. Acompanha o alfabeto braille.'),
(82, 2, 'Pra classificar', 'Brinquedo composto de uma prancheta quadrada, de 32 cm de lado, feita de material leve e macio, com uma das faces vermelha e a outra amarela. Acompanham 10 pequenas placas de 3 x 2 cm, cada uma delas imitando uma cela braille, sendo quatro delas com o sinal de número e as outras representando um número de 1 a 6. Constam ainda do material 24 exemplares de quatro diferentes tipos de objetos, sendo seis peças de cada tipo. Acompanha também um recipiente de plástico redondo'),
(83, 2, 'Mini alphabraille', 'Brinquedo composto de uma placa retangular feita de material leve e macio  medindo 14,5 x 10 cm.\r\nNesta placa estão recortados 8 retângulos que medem 5 x 3 cm.\r\nNa superfície dos retângulos existem 6 orifícios reproduzindo a cela braille.\r\nAcompanham 32 pinos de plástico colorido para serem encaixados nos orifícios e formar a letra braille.\r\nAcompanha o alfabeto braille.'),
(84, 2, 'Uni duni tê', 'Brinquedo feito de material leve e macio, amarelo, reproduzindo as mãos direita e esquerda. Na ponta dos dedos da mão esquerda estão os números de 1 a 5 iniciando no dedo mínimo. Na mão direita estão os números de 6 a 10 iniciando pelo polegar. Os números estão escritos em braille e em tinta.'),
(85, 2, 'Pé ante pé', 'Brinquedo feito de material leve e macio, representando 5 pares de pés, um par de cada cor: vermelho, azul, amarelo, verde e laranja. Nos pés estão inscritos os números de 1 a 10 de tal forma que de cada cor existe um número par e um ímpar. Os números estão em braille e em tinta.'),
(86, 2, 'Alphabraille', 'Brinquedo composto de 12 retângulos feitos de material leve e macio, medindo cada um 8 x14 cm. Cada retângulo representa uma cela braille. Contém ainda 48 pequenos círculos para encaixar nos orifícios, os quais, quando colocados, ficarão em relevo e poderão formar as letras. Acompanha o alfabeto braille.'),
(87, 2, 'Numerito', 'Gaveteiro de plástico medindo 54 cm de comprimento, 22 de largura e 12 de profundidade, composto de 10 gavetas dispostas em 2 colunas verticais. Dentro de cada gaveta existem objetos absolutamente iguais entre si, em quantidade correspondente à inscrição frontal. São objetos de uso comum, do dia-a-dia da criança.'),
(88, 2, 'Colméia alfabética', 'Estante retangular de madeira medindo 79 cm de altura, 67 de largura, 16 de profundidade.\r\nComposta de 24 compartimentos, dispostos em 4 fileiras de 6 compartimentos.\r\nCada compartimento contém alguns objetos cujo nome inicia com a letra inscrita na frente (menos o último, que está vazio);\r\nOs objetos são simples, pertencentes ao dia-a-dia da criança, feitos de material variado.\r\nAcompanha o alfabeto braille.'),
(89, 2, 'Brincando com as horas', 'Livro de material emborrachado, medindo 30 x 22 cm com seis folhas.\r\nA última folha contém uma dobra e, ao ser aberta, fica em posição superior às outras. Nela encontra-se um relógio de forma redonda, com números em braille e em tinta.\r\nCada folha contém frases em braille e em tinta com descrições de fatos que acontecem nas diferentes horas e períodos do dia, com atividades que fazem parte do cotidiano das crianças.\r\nAs frases são ilustradas com elementos concretos, objetos familiares, pertencentes ao dia-a-dia da criança.'),
(90, 2, 'Dolly', 'Livro de feltro, com seis folhas,  na medida de 0,20 x 0,20 cm.\r\nNa capa encontra-se um cachorrinho de pelúcia.\r\nNa parte superior de cada folha há uma frase correspondente à história de um cachorrinho, escrita em braille e em tinta.\r\nTodas as folhas contêm brinquedos, miniaturas de objetos que ilustram a frase ali escrita.'),
(91, 2, 'Horabraille', 'Relógio feito de madeira revestida de fórmica, medindo 20 x 20 cm.\r\nOs ponteiros são móveis, feitos em material emborrachado.\r\nOs números são escritos em braille.'),
(92, 2, 'Que horas são?', 'Relógio feito de madeira revestida de fórmica, medindo 24 x 15 cm.\r\nOs ponteiros são móveis, feitos em material emborrachado.\r\nNo lugar dos números existem orifícios formando celas braille.\r\nAcompanham pinos para serem encaixados nas celas para formar os números.'),
(93, 2, 'Livro sensorial - vol. 02', 'Livro composto de sessenta páginas, em dois volumes, medindo 36 x 22 cm, com duzentas e quatro figuras em relevo.\r\nAs figuras são feitas de materiais bem variados: espuma, tecido, madeira, plástico, barbante, material emborrachado e outros.\r\nAs figuras são coloridas e o livro é atraente também para as crianças que enxergam.\r\nO livro possui um kit com figuras recortadas que possibilita à criança representar cenas que ilustrem histórias por ela criadas, aplicando os conhecimentos adquiridos.\r\nA última folha do livro é uma tela de nylon que permite à criança fazer representações gráficas em relevo, bastando para isso usar uma folha de papel sobre a tela e uma caneta sem ponta.'),
(94, 2, 'Livro sensorial - vol. 01', 'Livro composto de sessenta páginas, em dois volumes, medindo 36 x 22 cm, com duzentas e quatro figuras em relevo.\r\nAs figuras são feitas de materiais bem variados: espuma, tecido, madeira, plástico, barbante, material emborrachado e outros.\r\nAs figuras são coloridas e o livro é atraente também para as crianças que enxergam.\r\nO livro possui um kit com figuras recortadas que possibilita à criança representar cenas que ilustrem histórias por ela criadas, aplicando os conhecimentos adquiridos.\r\nA última folha do livro é uma tela de nylon que permite à criança fazer representações gráficas em relevo, bastando para isso usar uma folha de papel sobre a tela e uma caneta sem ponta.'),
(95, 2, 'A carta', 'Brinquedo composto de uma maleta de plástico com 22 x 20 cm contendo objetos referentes à elaboração e ao envio de uma carta.\r\nUm cartão com uma pequena história escrita em braille e em escrita comum acompanha o kit.'),
(96, 2, 'O circo', ''),
(97, 2, 'Ajudando a mamãe', 'Livro feito em tecido com 22 X 20 cm tendo como tema as atividades e afazeres domésticos.\r\nPossui  8 folhas, presas com um laço de fita.\r\nCada folha contém uma ou duas frases, em braille e em tinta, e elementos em relevo que ilustram as frases; são objetos do dia-a-dia, familiares à criança, roupas e utensílios usados na alimentação.'),
(99, 2, 'Os brinquedos de Larinha', 'Brinquedo composto de uma maleta de plástico medindo 25 x 21 cm, contendo vários brinquedos em  miniaturas.\r\nUma placa de papelão presa à maleta traz uma pequena história escrita em braille e em tinta.\r\nAs miniaturas são objetos que ilustram a história.'),
(100, 2, 'What do I do with it?', 'Caderno medindo 21 x 13 cm, contendo 30 folhas de plástico separadas ao meio, formando assim dois compartimentos, no total de 60 compartimentos.\r\nNo lado esquerdo de cada folha há um cartão com figuras simples e de fácil compreensão pela criança, coloridas, representando objetos.\r\nNo final do caderno há uma bolsa, contendo 30 cartões com figuras que representam verbos ou ações que podem ser praticadas com os objetos que fazem parte dos cartões encaixados na bolsa da esquerda.\r\nO nome do objeto e da ação em inglês está escrito sobre cada uma das figuras. No final do livro existe um vocabulário com a tradução das 60 palavras para o português.'),
(101, 2, 'Bug-ball', 'Painel circular com 197 cm de diâmetro e 6 de espessura, forrado com tecido de nylon de cor preta, fechado com zíper, removível.\r\nNuma das faces estão coladas figuras de cinco animais, uma no meio e as outras na posição dos quatro pontos cardeais.\r\nAs figuras, nas cores vermelha, azul, amarela e verde, representam um cachorro, um gato, um elefante, um peixe e uma ave.\r\nO nome das quatro cores está escrito em inglês no lugar correspondente.\r\nO painel possui uma alça para que possa ser pendurado.\r\nAcompanham duas bolas pretas, revestidas de tecido pluma que facilita a aderência no velcro do painel.'),
(102, 2, 'Tack', 'Brinquedo composto de nove placas recortadas em material leve e macio, em cores diferentes, nas seguintes formas: Quadrado, Triângulo, Círculo, Retângulo, Losango, Oval, Coração, Estrela, Hexágono Cada placa tem inscrito o nome em braille e em tinta. Em toda a volta das figuras encontram-se furos. Acompanham 9 cadarços nas cores das placas.'),
(103, 2, 'Looking for opposites', 'Livro com 26 x 16 cm, contendo 25 folhas cortadas ao meio, num total de 50 meias folhas em espiral. O livro contém 50 figuras, 25 nas folhas da esquerda e 25 nas folhas da direita. No lado esquerdo são figuras de objetos e fatos opostos àqueles que estão nas folhas da direita. Na parte superior de cada figura está escrito seu nome em inglês. São figuras interessantes, coloridas, representando objetos ou fatos simples, conhecidos pelas crianças. No final do livro existe um vocabulário com a tradução das 50 palavras para o português.'),
(104, 2, 'Baixa Visão na Infância', '<i><font size="3">Manual Básico para Oftalmologistas</font></i><br><br>\r\n\r\nSubsídios ao atendimento da criança com baixa visão, recursos para a avaliação e auxílios especiais.\r\n<br><br>\r\nAutores:<br>\r\n<i>\r\n<b>\r\nMaria Aparecidade Onuki Haddad<br>\r\nMarco Wilson Sampaio<br>\r\nNewton Kara-josé<br>\r\n</b>\r\n</i>\r\n<br>\r\n44 Páginas.'),
(123, 2, 'Lingua do P', 'Pote de plástico redondo com tampa com 27 cm de diâmetro e 14 de altura.\r\nNa tampa do pote está colado um retângulo de 8 x 14 cm com seis orifícios, representando a cela braille. Um pequeno corte identifica o canto superior direito do retângulo. Acompanham seis pequenos círculos que podem ser encaixados nos orifícios e servem para formar uma letra em braille.\r\nPara crianças com visão, utilizar letras comuns feitas de plástico ou de papelão.\r\nNo interior do pote encontram-se objetos diferentes, feitos de materiais variados, cujos nomes iniciam pela letra P. São objetos simples, do dia-a-dia da criança. Acompanha o alfabeto braille.'),
(122, 2, 'Toque de letra', 'Placa de plástico medindo 10 x 14 cm em cuja superfície encontram-se seis cavidades circulares com 4,5 cm de diâmetro.\r\nSeis bolas de pingue-pongue encaixadas nas cavidades.\r\nNa parte superior da placa, à direita, um pedaço de velcro que serve para identificar a posição em que a placa deverá estar na hora da brincadeira (à direita, em cima).'),
(106, 2, 'O Desenvolvimento Integral do Portador de Deficiência Visual', '<i><font size="3">Da Intervenção Precoce à Integração Escolar</font></i><br><br>\r\nO desenvolvimento visual e global da criança com visão normal e as necessidades especiais da criança com defiência visual.\r\nSugestões que facilitam a inclusão da criança em idade pré-escolar.\r\n<br><br>\r\nAutora:<br>\r\n<i>\r\n<b>\r\nMarilda Moraes Garcia Bruno<br>\r\n</b>\r\n</i>\r\n<br>\r\n144 Páginas.'),
(121, 2, 'Form Color', 'Prancheta preta, retangular, com textura lisa, de material leve e macio, medindo 27 x 22 cm, tendo em uma das faces vinte orifícios nas quatro formas geométricas principais: cinco quadrados, cinco círculos, cinco retângulos e cinco triângulos.\r\nVinte placas de textura granulosa, com as mesmas formas geométricas, sendo cada forma de uma cor: amarelo, azul, verde e vermelho.'),
(107, 2, 'Deficiência Visual', '<i><font size="3">Reflexão Sobre a Prática Pedagógica </font></i><br><br>\r\nConceitos e definições sobre educação geral e especial com relatos de experiências.\r\n<br><br>\r\nAutora:<br>\r\n<i>\r\n<b>\r\nMarilda Moraes Garcia Bruno<br>\r\n</b>\r\n</i>\r\n<br>\r\n124 Páginas.'),
(108, 2, 'Orientação e Mobilidade', 'Subsídios aos familiares, estudantes e profissionais de intervenção precoce, educação especial e reabilitação de pesoas com deficiência visual.\r\n<br><br>\r\nAutores:<br>\r\n<i>\r\n<b>\r\nJoão Álvaro de Moraes Felippe<br>\r\nVera Lúcia Rhein Felippe<br>\r\n</b>\r\n</i>\r\n<br>\r\n179 Páginas.'),
(146, 2, 'Ler e Escrever em Braille', 'Roteiro de atividades que favorecem o desenvolvimento da criança cega, do nascimento à inclusão escolar.<br>\r\nAutora:<br>\r\n<b><i>\r\nMara O. de Campos Siaulys<br>\r\n</b></i>\r\n16 páginas'),
(142, 2, 'Manual Para Creches', 'Esclarecimentos sobre as necessidades da criança com deficiência visual, aos profissionais de creches e pré-escolas.\r\n<br><br>\r\nAutoras:<br>\r\n<i>\r\n<b>\r\nEdna Eiko Nakahara<br>\r\nMargareth Pires da Motta<br>\r\nMaria Teresa R. Triñanes<br>\r\nRosana S. A. S. Furtado\r\n</b>\r\n</i>\r\n<br><br>\r\n18 Páginas.'),
(145, 2, 'Papai, Mamãe - Ajudem-me Por Favor', 'Sugestões que facilitam a interação com o bebê deficiente visual.\r\n\r\n<br><br>\r\nAutora:<br>\r\n<i>\r\n<b>\r\nMara O. de campos Siaulys<br>\r\n</b>\r\n</i>\r\n<br>\r\n44 Páginas.'),
(141, 2, 'GANMA Laramara', '<i><font size="4">Brincando em família</font></i><br><br>\r\nComo favorecer a brincadeira, a interação, comunicação e participação da criança com disfunção neuromotora associada à deficiência visual, na família.\r\n\r\n\r\n<br><br>\r\nAutoras:<br>\r\n<i>\r\n<b>\r\nMaria Teresa Rocha Triñanes<br>\r\nRosana S. A. S. Furtado<br>\r\nSônia Mitíco F. Gondo<br>\r\n</b>\r\n</i>\r\n<br>\r\n8 Páginas.'),
(115, 2, 'Passatempo', 'Falta'),
(116, 2, 'Caixinha de números', 'Material composto de 10 caixas iguais, medindo cada uma 13,5 x 7 cm, feitas de plástico transparente.\r\nNa tampa de cada caixa, encontra-se um número de 1 a 10 em braille e em tinta.\r\nNo interior de cada caixa, existem objetos exatamente iguais entre si, em quantidade correspondente ao número inscrito na tampa.\r\nEsses objetos devem ser de uso comum, pertencentes ao dia-a-dia da criança, de fácil reconhecimento quando manuseados.'),
(140, 2, 'Caminhado Juntos', '<i><font size="3">Manual de Habilidades de Orientação e Mobilidade</font></i><br><br>\r\nInformações simples e práticas para a orientação da pessoa cega.\r\n\r\n<br><br>\r\nAutor:<br>\r\n<i>\r\n<b>\r\nJoão Álvaro de Moraes Felippe<br>\r\n</b>\r\n</i>\r\n<br>\r\n56 Páginas.'),
(143, 2, 'Orientação aos Professores na Integração', '<b>Escolar da Criança com Baixa Visão</b><br><br>\r\nAdaptações importantes para a inclusão das crianças com baixa visão na classe comum.\r\n<br><br>\r\nAutora:<br>\r\n<i>\r\n<b>\r\nHsu Yun Min<br>\r\n</b>\r\n</i>\r\n<br><br>\r\n4 Páginas.'),
(120, 2, 'Móbile de brinquedos', 'Móbile de brinquedos\r\n2 ripas de madeira cruzadas com 26 cm de comprimento\r\nNas 4 pontas das ripas existem orifícios por onde passam barbantes de 30 cm ou menos, que se encontram na parte superior para pendurar\r\nNas 4 pontas dos barbantes estão pendurados 4 brinquedos  que são: bonequinha, chocalho, pratinho de plástico e colherzinha.'),
(130, 2, 'DVD - Aprendizagem e Desenvolvimento da Criança com Deficiência', 'As necessidades específicas da criança com deficiência visual do nascimento a adolescência.<br><br>\r\n\r\n<B>DVD</B><BR><BR>\r\nAutora:<br>\r\n<i><b>\r\nMara O. de Campos Siaulys<br>\r\n</b>\r\n</i>'),
(131, 2, 'Kit Baixa Visão lll', 'KIT III<br>\r\n2 MANUAIS<br>\r\n+ 1 CD ROM<br>\r\n+ 1 FITA DE VÍDEO VHS\r\n- Avaliação e Recursos para Baixa Visão na Infância'),
(132, 2, 'Auxílios Para Baixa Visão', '<b>Coleção Baixa Visão - Volume I</b><br><br>\r\nPrincipais auxílios ópticos, não ópticos e eletrônicos, características, vantagens, desvantagens e treinamento para seu uso.<br><br>\r\nAutores:<br>\r\n<b><i>\r\nMaria Aparecida Onuki Haddad<br>\r\nMarcos Wilson Sampaio<br>\r\nNewton Kara-josé<br>\r\n</b></i>\r\n98 Páginas'),
(133, 2, 'Kit Auxílios para Baixa Visão', '1 Manual Baixa Visão: Conhecendo mais para ajudar melhor<br>\r\n2 Caderno de pautas ampliadas (favorecendo a escrita de letras ampliadas e melhorando o contraste)<br>\r\n1 lápis 4B<br>\r\n1 lápis 6B<br>\r\n1 caneta azul<br>\r\n1 caneta preta<br>\r\n1 guia de leitura acompanhada de texto exemplo<br>\r\n1 prancha inclinada para leitura porta-texto'),
(134, 2, 'Cd´s Contato', 'KIT COM 8 CD''s <br>\r\nVersão áudio'),
(135, 2, 'A Liberdade Cria Asas', 'História Infantil\r\nAutoras:\r\nMaria Tereza R. Triñares \r\nRegiane Serafim\r\nRosana Furtado\r\nSônia Mitico Fucasse Gonalo\r\n \r\n6 páginas'),
(136, 2, 'Papai e Mamãe, Vamos Brincar', 'A confecção e uso de brinquedos como proposta de interação entre pais e filhos.\r\n<br><br>\r\nAutora:<br>\r\n<i>\r\n<b>\r\nMara O. de Campos Siaulys<br>\r\n</b>\r\n</i>\r\n<br>\r\n70 Páginas.'),
(139, 2, 'Baixa Visão: Conhecendo Mais para Ajudar Melhor', 'Esclarecimentos sobre baixa visão e sugestões de atividades, modificações ambientais e materiais para melhorar a eficiência visual e o desenvolvimento da criança com deficiência visual.\r\n<br><br>\r\nAutores:<br>\r\n<i>\r\n<b>\r\nHsu Yun Min<br>\r\nMarcos Wilson Sampaio<br>\r\nMaria Aparecida Onuki Haddad<br>\r\n</b>\r\n</i>\r\n<br><br>\r\n36 Páginas.'),
(138, 2, 'A Esperança do Sucesso em Matemática está na Semente', 'Como usar o Cuisinare gigante e adaptado na aprendizagem da matemática.\r\n<br><br>\r\nAutora:<br>\r\n<i>\r\n<b>\r\nWilma Pires de Miranda<br>\r\n</b>\r\n</i>\r\n<br><br>\r\n6 Páginas.'),
(147, 2, 'Aprendendo junto com Papai e Mamãe', 'Em linguagem simples e esclarecedora, este manual facilita a tarefa da família na educação de seus filhos com baixa visão.<br>\r\nAutora:<br>\r\n<b><i>Mara O. de Campos Siaulys</i></b><br>\r\n28 páginas'),
(148, 2, 'DVD - Ganma Laramara', 'Brincadeiras adaptadas à crianças com deficiência neuromotora associada à deficiência visual.');
INSERT DELAYED IGNORE INTO `marco2` (`product_id`, `language_id`, `name`, `description`) VALUES
(149, 2, 'Jogo da memória', 'Tabuleiro de EVA amarelo medindo 36 x 24 cm com tiras de 0,5 cm de espessura, formando 24 quadrados de 5,5 cm. Contém 24 peças quadradas de EVA vermelho, medindo 5 cm cada, formando 12 pares com texturas (algodão, cortiça, tela de nylon, tela plástica, feltro, lixa, carpete, espuma, pelúcia, papel canelado, tapete emborrachado com listras em revelo, tapete emborrachado com bolinhas em relevo), que se encaixam nos quadrados do tabuleiro.'),
(150, 2, 'Toque o Bebê', 'Informações uteis para a melhor convivência com a criança deficiente visual. Dirigido aos médicos e profissionais de saúde.\r\n\r\nAdaptado por: Mara O. de Campos Siaulys\r\n18 páginas.'),
(151, 2, 'Livro Brincar Para Todos', 'Sugestões para a confecção e brincadeiras com 109 brinquedos especiais. <br> Competências e habilidades que eles favorecem.\r\n<br>\r\n<br>\r\nAutora:<br>\r\nMara O. de Campos Siaulys\r\n<br>\r\n<br>\r\n152 páginas'),
(152, 2, 'Em cima da hora', 'De maneira simples e rápida este brinquedo facilita às pessoas cegas a localização dos alimentos em seu prato.<br>\r\nBasta que ele seja informado sobre o nome do alimento colocado na direção de determinada hora.\r\n<br><br>\r\n\r\n12hs arroz<br>\r\n3hs feijão<br>\r\n6 hs ovo frito<br>\r\n9hs salsicha<br>\r\n<br><br>\r\n\r\nPara crianças pequenas o brinquedo ajuda no reconhecimento tátil dos alimentos crus, seus nomes e como escrevê-los. Desenvolve o tato e o vocabulário.'),
(153, 2, 'Em Cima da Hora', 'O brinquedo facilita à criança cega no conhecimento tátil de 12 alimentos crus, assim como seus nomes escritos em Braille. \r\n\r\nO prato localizado na parte de baixo do painel ajuda a pessoa cega a localizar os alimentos nele colocados.\r\n\r\nVamos fazer de conta que o prato é um relógio e posicionar a plaquinha com um tipo de alimento em determinada hora. Por exemplo, o arroz ao meio-dia, o feijão ás 3 horas, o ovo frito às 6 horas, e a salsicha às 9 horas.'),
(154, 2, 'CD Brincar Para Todos', 'Composto por 5 CD´s\r\nVersão Áudio'),
(156, 2, 'Mercenário ou Missionário?', 'É um livro corajoso que descreve as  \r\nlições aprendidas como empreendedor social e empresário exitoso.\r\nSaiba como um vendedor de peixes na feira livre conseguiu construir  \r\numa das maiores indústrias farmacêuticas do Brasil e da América do  \r\nSul, sem deixar de transferir para famílias carentes toda a experiência  \r\nacumulada na educação de sua filha cega.\r\n<br>\r\n<br>\r\n<b><i>Autor: Victor Siaulys, fundador da instituição Laramara junto com sua esposa Mara Siaulys.</b></i>\r\n<br><br>\r\n360 páginas'),
(157, 2, 'Revista Contato 8', '<b><i>Contato - Conversas sobre Deficiência Visual </i></b><br> \r\n<br>\r\n\r\nLouis Braille 200 anos do nascimento - \r\nEspecial Manual Ilustrado para o uso do Braille - \r\nRevista da Laramara Associação Brasileira de Assistência ao Deficiente Visual -  Número 8 - Novembro 2009 - </i></b><br>\r\n\r\n\r\n\r\n</i></b><br> \r\n<br>\r\n130 páginas'),
(158, 2, 'A Inclusão do Aluno com Baixa Visão no Ensino Regular c/ DVD', '<br>\r\n<i>\r\n<b>\r\nOrientações aos Professores da Escola Regular \r\n\r\n</i></b><br> \r\n<br>Inclusão social, um desafio: mudar a prática, a atitude e a cultura.\r\nEstar na escola não é suficiente!\r\n</i></b><br> \r\n<br>\r\n<br>Autora do projeto: <br>\r\n<i>\r\n<b>\r\nMara Olimpia de Campos Siaulys </i></b><br> \r\n\r\n<br>\r\n<br>74 páginas'),
(159, 2, 'CD Revista Contato 8', 'Conversas sobre Deficiência Visual </i></b><br> \r\n\r\n<br>\r\nLouis Braille 200 anos do nascimento \r\n\r\n<br>\r\nCD Rom (Versão Áudio)'),
(160, 2, 'DVD Brincar Para Todos', 'Passo-a-passo para a confecção de brinquedos especiais, produzidos e comercializados na Laramara. Sugestões de brincadeiras, competências e habilidades que eles favorecem.\r\n<br>\r\n<br>\r\nAutora:<br>\r\nMara O. de Campos Siaulys\r\n<br>\r\n<br>'),
(161, 2, 'Avaliação Educacional de Alunos com Baixa Visão e Múltipla Defic', 'Este livro apresenta subsídios teóricos para a compreensão das necessidades específicas de crianças com múltipla deficiência; descreve os itens e procedimentos da avaliação funcional da visão...\r\n</i></b><br> \r\n<br>\r\n<br>Autora: <br>\r\n<i>\r\n<b>\r\nMarilda Moraes Garcia Bruno </i></b><br> \r\n\r\n<br>\r\n<br>196 páginas');

