(61, 2, 'Desenvolver o prazer da leitura com livros interativos', '', '', '&lt;div&gt;\r\n	&lt;em style=&quot;color: rgb(0, 0, 255); &quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;Os objetivos desses brinquedos s&amp;atilde;o:&lt;/span&gt;&lt;/strong&gt;&lt;/em&gt;&lt;/div&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;font-family:tahoma,geneva,sans-serif;&quot;&gt;Ajudar no aprendizado da representa&amp;ccedil;&amp;atilde;o&amp;nbsp;bidimensional de objetos, forma, grandeza,&amp;nbsp;cenas e hist&amp;oacute;rias.&lt;br /&gt;\r\n		&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;font-family:tahoma,geneva,sans-serif;&quot;&gt;Favorecer o aprendizado de leitura e escrita&amp;nbsp;Braille com pequenas hist&amp;oacute;rias.&lt;br /&gt;\r\n		&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;font-family:tahoma,geneva,sans-serif;&quot;&gt;Favorecer a utiliza&amp;ccedil;&amp;atilde;o de objetos concretos&amp;nbsp;para representar cenas e hist&amp;oacute;rias.&lt;br /&gt;\r\n		&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;font-family:tahoma,geneva,sans-serif;&quot;&gt;Ajudar na comunica&amp;ccedil;&amp;atilde;o por meio da escrita&lt;br /&gt;\r\n		&lt;/span&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n'),
(44, 2, 'Compreender e identificar os sons', '', '', '&lt;p&gt;\r\n	&lt;em style=&quot;color: rgb(0, 0, 255); &quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;Os objetivos desses brinquedos s&amp;atilde;o:&lt;/span&gt;&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;font-family:verdana,geneva,sans-serif;&quot;&gt;Favorecer a abertura das m&amp;atilde;os, sua jun&amp;ccedil;&amp;atilde;o na linha&amp;nbsp;m&amp;eacute;dia e o desenvolvimento da coordena&amp;ccedil;&amp;atilde;o bimanual.&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;font-family:verdana,geneva,sans-serif;&quot;&gt;Favorecer a identifica&amp;ccedil;&amp;atilde;o e reconhecimento dos sons&amp;nbsp;do ambiente e a localiza&amp;ccedil;&amp;atilde;o de objetos pelo som.&lt;/span&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n'),
(53, 2, 'Desenvolver e integrar os sentidos', '', '', '&lt;p&gt;\r\n	&lt;span style=&quot;color:#00f;&quot;&gt;&lt;em&gt;&lt;strong&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;Os objetivos desses brinquedos s&amp;atilde;o:&lt;/span&gt;&lt;/strong&gt;&lt;/em&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li style=&quot;text-align: justify; &quot;&gt;\r\n		&lt;span style=&quot;font-family:tahoma,geneva,sans-serif;&quot;&gt;Desenvolver a coordena&amp;ccedil;&amp;atilde;o ouvido-m&amp;atilde;o.&lt;br /&gt;\r\n		&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li style=&quot;text-align: justify; &quot;&gt;\r\n		&lt;span style=&quot;font-family:tahoma,geneva,sans-serif;&quot;&gt;Desenvolver a preens&amp;atilde;o, estimulando o&amp;nbsp;desejo de estender o bra&amp;ccedil;o para tocar e pegar despertar a vontade de procurar, pegar, apertar,&amp;nbsp;raspar, chacoalhar, bater e morder objetos.&lt;br /&gt;\r\n		&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li style=&quot;text-align: justify; &quot;&gt;\r\n		&lt;span style=&quot;font-family:tahoma,geneva,sans-serif;&quot;&gt;Favorecer a integra&amp;ccedil;&amp;atilde;o dos sentidos e a percep&amp;ccedil;&amp;atilde;o de&amp;nbsp;objetos pelo tato, som, aroma e sabor&amp;nbsp; incentivar a jogar, atirar, retomar, correr despertar a curiosidade, o movimento com sentido&amp;nbsp;de busca e dire&amp;ccedil;&amp;atilde;o.&lt;br /&gt;\r\n		&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li style=&quot;text-align: justify; &quot;&gt;\r\n		&lt;span style=&quot;font-family:tahoma,geneva,sans-serif;&quot;&gt;Favorecer atividades como: saltar, agachar e levantar,&amp;nbsp;rolar, pular corda, escorregar.&lt;br /&gt;\r\n		&lt;/span&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n'),
(54, 2, 'Desenvolver habilidade para encaixe e pinça', '', '', '&lt;p style=&quot;text-align: justify; &quot;&gt;\r\n	&lt;em style=&quot;color: rgb(0, 0, 255); text-align: -webkit-auto; &quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;Os objetivos desses brinquedos s&amp;atilde;o:&lt;/span&gt;&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;font-family:tahoma,geneva,sans-serif;&quot;&gt;Despertar a curiosidade e o desejo de conhecer,&amp;nbsp;o prazer de procurar, tocar e manusear.&lt;br /&gt;\r\n		&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;font-family:tahoma,geneva,sans-serif;&quot;&gt;Desenvolver a coordena&amp;ccedil;&amp;atilde;o motora, adquirir&amp;nbsp;habilidade para encaixe e pin&amp;ccedil;a.&lt;br /&gt;\r\n		&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;font-family:tahoma,geneva,sans-serif;&quot;&gt;Introduzir o aprendizado da classifica&amp;ccedil;&amp;atilde;o,&amp;nbsp;seq&amp;uuml;&amp;ecirc;ncia e seria&amp;ccedil;&amp;atilde;o.&lt;br /&gt;\r\n		&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;font-family:tahoma,geneva,sans-serif;&quot;&gt;Desenvolver a mem&amp;oacute;ria.&lt;br /&gt;\r\n		&lt;/span&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n'),
(55, 2, 'Desenvolver o tato para reconhecer texturas', '', '', '&lt;p style=&quot;text-align: justify; &quot;&gt;\r\n	&lt;em style=&quot;color: rgb(0, 0, 255); text-align: -webkit-auto; &quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;Os objetivos desses brinquedos s&amp;atilde;o:&lt;/span&gt;&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;font-family:tahoma,geneva,sans-serif;&quot;&gt;Favorecer o uso do tato para o&amp;nbsp;conhecimento de texturas, forma,&amp;nbsp;temperatura, grandeza, peso, consist&amp;ecirc;ncia&amp;nbsp;e materiais de que s&amp;atilde;o feitos os objetos.&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;Favorecer o desejo de manusear, brincar,&amp;nbsp;empilhar, encaixar, tampar e destampar,&amp;nbsp;separar e juntar.&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;Desenvolver a estrutura&amp;ccedil;&amp;atilde;o e organiza&amp;ccedil;&amp;atilde;o&amp;nbsp;espacial, a no&amp;ccedil;&amp;atilde;o de direita e esquerda.&lt;/span&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n'),
(56, 2, 'Reconhecer os objetos do ambiente', '', '', '&lt;p&gt;\r\n	&lt;em style=&quot;color: rgb(0, 0, 255); &quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;Os objetivos desses brinquedos s&amp;atilde;o:&lt;/span&gt;&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		Incentivar a descoberta, identifica&amp;ccedil;&amp;atilde;o e reconhecimento de objetos,de suas caracter&amp;iacute;sticas; estabelecer as diferen&amp;ccedil;as e semelhan&amp;ccedil;as entre eles; conhecer seu nome, sua utilidade e saber como manej&amp;aacute;-los.&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Incentivar a utiliza&amp;ccedil;&amp;atilde;o de objetos para representar cenas e hist&amp;oacute;rias.&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Favorecer a amplia&amp;ccedil;&amp;atilde;o do vocabul&amp;aacute;rio... o desenvolvimento da linguagem,da comunica&amp;ccedil;&amp;atilde;o.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n'),
(58, 2, 'Brincar com pontinho e aprender braille', '', '', '&lt;p&gt;\r\n	&lt;em style=&quot;color: rgb(0, 0, 255); &quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;Os objetivos desses brinquedos s&amp;atilde;o:&lt;/span&gt;&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		Ajudar na familiariza&amp;ccedil;&amp;atilde;o com&amp;nbsp;os pontos e as letras do Braille&amp;nbsp;atrav&amp;eacute;s das brincadeiras,&amp;nbsp;do encaixe de pinos e pe&amp;ccedil;as.&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Incentivar o conhecimento de grande&amp;nbsp;variedade de materiais e objetos,&amp;nbsp;o aprendizado da escrita e leitura&amp;nbsp;de seus nome.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n'),
(59, 2, 'Divertir-se com os números', '', '', '&lt;p&gt;\r\n	&lt;em style=&quot;color: rgb(0, 0, 255); &quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;Os objetivos desses brinquedos s&amp;atilde;o:&lt;/span&gt;&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		Ajudar na aquisi&amp;ccedil;&amp;atilde;o do conceito de n&amp;uacute;mero e quantidade.&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Dar in&amp;iacute;cio ao aprendizado das opera&amp;ccedil;&amp;otilde;es matem&amp;aacute;ticas.&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Ajudar na escrita dos n&amp;uacute;meros em Braille.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n'),
(60, 2, 'Adquirir noção do tempo', '', '', '&lt;p&gt;\r\n	&lt;em style=&quot;color: rgb(0, 0, 255); &quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;Os objetivos desses brinquedos s&amp;atilde;o:&lt;/span&gt;&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		Desenvolver a no&amp;ccedil;&amp;atilde;o de tempo, horas, dias, semanas, m&amp;ecirc;s e ano.&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Favorecer o aprendizado sobre o rel&amp;oacute;gio e a leitura das horas.&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Introduzir o conhecimento sobre os fen&amp;ocirc;menos da natureza e esta&amp;ccedil;&amp;otilde;es do ano.&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Ajudar a estabelecer rela&amp;ccedil;&amp;atilde;o entre o tempo e fatos de sua pr&amp;oacute;pria vida.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n'),
(50, 2, 'Jogos Adaptados', '', '', '&lt;div&gt;\r\n	&lt;em style=&quot;color: rgb(0, 0, 255); &quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;Os objetivos desses brinquedos s&amp;atilde;o:&lt;/span&gt;&lt;/strong&gt;&lt;/em&gt;&lt;/div&gt;\r\n&lt;div&gt;\r\n	&lt;span style=&quot;font-family:tahoma,geneva,sans-serif;&quot;&gt;&lt;br /&gt;\r\n	&lt;/span&gt;&lt;/div&gt;\r\n&lt;div&gt;\r\n	&lt;span style=&quot;font-family:tahoma,geneva,sans-serif;&quot;&gt;Ajudar no entendimento das&amp;nbsp;regras do jogo e desenvolver&amp;nbsp;a sociabilidade.&lt;/span&gt;&lt;/div&gt;\r\n&lt;div&gt;\r\n	&lt;div&gt;\r\n		&lt;span style=&quot;font-family:tahoma,geneva,sans-serif;&quot;&gt;Favorecer o aprendizado de&amp;nbsp;cores e formas, de alinhavar&amp;nbsp;e costurar.&lt;/span&gt;&lt;/div&gt;\r\n&lt;/div&gt;\r\n'),
(62, 2, 'Aprender inglês', '', '', '&lt;div&gt;\r\n	Motivar a aprendizagem da&amp;nbsp;l&amp;iacute;ngua inglesa por meio&amp;nbsp;do brinquedo.&lt;/div&gt;\r\n'),
(45, 2, 'Despertar a curiosidade e o prazer de ver e buscar', '', '', '&lt;p style=&quot;text-align: -webkit-auto;&quot;&gt;\r\n	&lt;em style=&quot;color: rgb(0, 0, 255); &quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;Os objetivos desses brinquedos s&amp;atilde;o:&lt;/span&gt;&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li style=&quot;text-align: justify; &quot;&gt;\r\n		&lt;span style=&quot;font-family:verdana,geneva,sans-serif;&quot;&gt;Desenvolver a coordena&amp;ccedil;&amp;atilde;o binocular,&amp;nbsp;a coordena&amp;ccedil;&amp;atilde;o olho-m&amp;atilde;o e a preens&amp;atilde;o&amp;nbsp; despertar a curiosidade e o prazer de ver, buscar,&amp;nbsp;fixar e seguir objetos a diferentes dist&amp;acirc;ncias.&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li style=&quot;text-align: justify; &quot;&gt;\r\n		&lt;span style=&quot;font-family:verdana,geneva,sans-serif;&quot;&gt;Ajudar a fortalecer a musculatura do pesco&amp;ccedil;o, o&amp;nbsp;giro e controle da cabe&amp;ccedil;a&amp;hellip; a sentar, a engatinhar,&amp;nbsp;andar&amp;hellip; e a se deslocar no espa&amp;ccedil;o introduzir o aprendizado das cores e&amp;nbsp;a discrimina&amp;ccedil;&amp;atilde;o das formas favorecer a observa&amp;ccedil;&amp;atilde;o de figuras e seus detalhes desenvolver a capacidade de comparar e parear ajudar a distinguir entre figuras e objetos concretos desenvolver o jogo simb&amp;oacute;lico, o faz-de-conta.&lt;/span&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n'),
(57, 2, 'Adquirir independência e autonomia', '', '', '&lt;p&gt;\r\n	&lt;em style=&quot;color: rgb(0, 0, 255); &quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;Os objetivos desses brinquedos s&amp;atilde;o:&lt;/span&gt;&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		Introduzir o aprendizado sobre as partes do corpo,&amp;nbsp;os nomes e fun&amp;ccedil;&amp;otilde;es.&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Desenvolver a auto-estima e auto-aceita&amp;ccedil;&amp;atilde;o.&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Ajudar na identifica&amp;ccedil;&amp;atilde;o dos objetos familiares pelo aroma, favorecer o reconhecimento dos alimentos pelo aroma,&amp;nbsp;sabor, forma, textura e como prepar&amp;aacute;-los, favorecer o aprendizado sobre os objetos usados nas&amp;nbsp;atividades cotidianas&amp;hellip; como alimentar-se, vestir-se e&amp;nbsp;fazer sua pr&amp;oacute;pria higiene: abotoar e desabotoar, dar la&amp;ccedil;o,&amp;nbsp;usar z&amp;iacute;per&amp;hellip; dobrar roupas, pendurar&amp;hellip;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Familiarizar-se com a bengala ou objeto que&amp;nbsp;ajude a mobilidade ao andar.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n');

