INSERT DELAYED IGNORE INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES
(5, 2, 'Segurança', '&lt;p&gt;\r\n	&lt;strong style=&quot;color: rgb(0, 0, 255); &quot;&gt;Compra Segura:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify; &quot;&gt;\r\n	Temos um especial compromisso com voc&amp;ecirc;, nosso cliente, quanto &amp;agrave; seguran&amp;ccedil;a e privacidade de seus dados. O respeito ao cliente e o sigilo de suas informa&amp;ccedil;&amp;otilde;es &amp;eacute; muito importante para n&amp;oacute;s.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;&lt;span style=&quot;color:#00f;&quot;&gt;Criptografia:&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify; &quot;&gt;\r\n	Nossa loja possui um sistema totalmente seguro para os dados de nossos clientes. Para se cadastrar como nosso cliente &amp;eacute; necess&amp;aacute;rio ter um e-mail v&amp;aacute;lido e gerar uma senha em nosso sistema. Esta senha &amp;egrave; criptografada em nosso banco de dados, de maneira que se voc&amp;ecirc; esquec&amp;ecirc;-la, nem mesmo os nossos funcion&amp;aacute;rios poder&amp;atilde;o recuper&amp;aacute;-la. Se voc&amp;ecirc; esquecer a sua senha, clique no link recuperar senha na p&amp;aacute;gina de login que o sistema criar&amp;aacute; uma nova senha e enviar&amp;aacute; para o seu endere&amp;ccedil;o de e-mail. A seguran&amp;ccedil;a de seus dados em nossa loja &amp;eacute; totalmente garantida, cabendo a voc&amp;ecirc; como nosso cliente, cuidar da seguran&amp;ccedil;a da caixa postal de e-mail que utilizar&amp;aacute; para abrir sua conta em nosso sistema. Qualquer d&amp;ugrave;vida, entre em &lt;a href=&quot;http://lojavirtual.laramara.org.br/index.php?route=information/contact&quot;&gt;contato&lt;/a&gt; com a nossa equipe.&lt;/p&gt;\r\n'),
(3, 2, 'Política de Privacidade', '&lt;p style=&quot;text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;N&amp;oacute;s da LARAMARA - queremos que voc&amp;ecirc; tenha grande satisfa&amp;ccedil;&amp;atilde;o visitando nosso site e que saiba que a confidencialidade das informa&amp;ccedil;&amp;otilde;es aqui deixadas est&amp;aacute; assegurada de acordo com esta Pol&amp;iacute;tica de Privacidade.&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;Podem existir neste site algumas &amp;aacute;reas de navega&amp;ccedil;&amp;atilde;o restrita, sendo que, para que voc&amp;ecirc; possa navegar nessas &amp;aacute;reas, poderemos lhe solicitar informa&amp;ccedil;&amp;otilde;es pessoais, que sempre depender&amp;atilde;o da maneira como voc&amp;ecirc; utiliza nossos servi&amp;ccedil;os.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;&amp;Eacute; importante ressaltar que toda informa&amp;ccedil;&amp;atilde;o fornecida por voc&amp;ecirc; ser&amp;aacute; mantida em sigilo e ser&amp;aacute; utilizada apenas para estreitar nosso relacionamento.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;strong&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;Uso Normal do Site&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;Para que voc&amp;ecirc; possa consultar informa&amp;ccedil;&amp;otilde;es gerais em nosso site, tais como produtos e servi&amp;ccedil;os, informa&amp;ccedil;&amp;otilde;es institucionais etc., n&amp;atilde;o lhe ser&amp;aacute; solicitada nenhuma informa&amp;ccedil;&amp;atilde;o pessoal, apenas seu email.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;Durante a navega&amp;ccedil;&amp;atilde;o normal em nosso site, s&amp;oacute; ser&amp;atilde;o coletadas informa&amp;ccedil;&amp;otilde;es relativas ao hist&amp;oacute;rico do servidor web utilizado por voc&amp;ecirc;, como por exemplo, provedor de acesso que voc&amp;ecirc; utilizou, p&amp;aacute;ginas que voc&amp;ecirc; navegou em nosso site, hora e data dessa navega&amp;ccedil;&amp;atilde;o etc.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;Utilizamos essas informa&amp;ccedil;&amp;otilde;es somente para gerar estat&amp;iacute;sticas de acesso e medir a efetividade de nosso site. Essas informa&amp;ccedil;&amp;otilde;es tamb&amp;eacute;m poder&amp;atilde;o ser partilhadas com nossos parceiros e ag&amp;ecirc;ncias de publicidade com o intuito &amp;uacute;nico de realizar an&amp;aacute;lises e melhorar nossos servi&amp;ccedil;os neste site.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;strong&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;Coleta de Informa&amp;ccedil;&amp;otilde;es Pessoais&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;Em v&amp;aacute;rios momentos neste site, a LARAMARA poder&amp;aacute; solicitar informa&amp;ccedil;&amp;otilde;es pessoais para que possa fornecer alguns servi&amp;ccedil;os espec&amp;iacute;ficos ao seu visitante. Estas informa&amp;ccedil;&amp;otilde;es (como nome, endere&amp;ccedil;o, e-mail etc.) s&amp;atilde;o solicitadas e armazenadas de maneira adequada e de acordo com esta Pol&amp;iacute;tica de Privacidade.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;Toda informa&amp;ccedil;&amp;atilde;o fornecida ser&amp;aacute; de nosso uso exclusivo e poder&amp;aacute; ser utilizada para melhorar os servi&amp;ccedil;os que a LARAMARA lhe oferece. Essas informa&amp;ccedil;&amp;otilde;es poder&amp;atilde;o ser fornecidas ao nosso distribuidor para uso exclusivo da LARAMARA e sempre de acordo com esta Pol&amp;iacute;tica de Privacidade. Suas informa&amp;ccedil;&amp;otilde;es pessoais n&amp;atilde;o ser&amp;atilde;o nunca fornecidas ou vendidas para qualquer outra empresa para uso independente.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;&amp;Eacute; sempre importante que voc&amp;ecirc; leia a Pol&amp;iacute;tica de Privacidade de qualquer site antes de fornecer informa&amp;ccedil;&amp;otilde;es pessoais.&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;strong&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;E-mail Contendo Informa&amp;ccedil;&amp;otilde;es Pessoais&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;Se voc&amp;ecirc; enviar suas informa&amp;ccedil;&amp;otilde;es pessoais via e-mail, tais informa&amp;ccedil;&amp;otilde;es ser&amp;atilde;o utilizadas somente para o objetivo descrito no e-mail. Poderemos agregar essas informa&amp;ccedil;&amp;otilde;es &amp;agrave;s demais informa&amp;ccedil;&amp;otilde;es que possu&amp;iacute;mos a seu respeito, tendo sempre como intuito a melhoria de nossos servi&amp;ccedil;os a voc&amp;ecirc;.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;strong&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;Revis&amp;atilde;o da Pol&amp;iacute;tica de Privacidade&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;Novas vers&amp;otilde;es deste site est&amp;atilde;o sujeitas a uma nova Pol&amp;iacute;tica de Privacidade que passar&amp;aacute; a vigorar apenas com o lan&amp;ccedil;amento da nova vers&amp;atilde;o do site.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;strong&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;Licen&amp;ccedil;a Limitada&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;Este site pertence &amp;agrave; LARAMARA &amp;ndash; e seu prop&amp;oacute;sito &amp;eacute; estritamente comercial e informativo. Navegar ou fazer downloads significa que voc&amp;ecirc; conhece nossa Pol&amp;iacute;tica de Privacidade e que concorda com todas os seus termos e condi&amp;ccedil;&amp;otilde;es descritos neste documento. Caso n&amp;atilde;o concorde integralmente com esses termos e condi&amp;ccedil;&amp;otilde;es, aconselhamos n&amp;atilde;o navegar.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;Ao concordar com a nossa Pol&amp;iacute;tica de Privacidade, voc&amp;ecirc; tem a garantia LARAMARA ao direito de acesso e uso deste site, o que implica poder visualizar seu conte&amp;uacute;do (imagens, textos etc.). Esse direito &amp;eacute; garantido desde que n&amp;atilde;o haja interfer&amp;ecirc;ncias de terceiros que possam vir a prejudicar o bom andamento deste site. Embora as informa&amp;ccedil;&amp;otilde;es pessoais fornecidas pelos visitantes aos sites da LARAMARA estejam ao abrigo desta Pol&amp;iacute;tica de Privacidade, toda a informa&amp;ccedil;&amp;atilde;o comunicada &amp;agrave; LARAMARA pela Internet, tais como, coment&amp;aacute;rios, sugest&amp;otilde;es, id&amp;eacute;ias e imagens, ser&amp;atilde;o de propriedade exclusiva da LARAMARA, n&amp;atilde;o havendo qualquer obriga&amp;ccedil;&amp;atilde;o de pagamento para qualquer pessoa. Neste caso, tais informa&amp;ccedil;&amp;otilde;es n&amp;atilde;o ser&amp;atilde;o consideradas confidenciais.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;strong&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;Condi&amp;ccedil;&amp;otilde;es Comerciais&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;Os pre&amp;ccedil;os e condi&amp;ccedil;&amp;otilde;es da Loja virtual LARAMARA s&amp;atilde;o v&amp;aacute;lidos apenas para as compras realizadas na Loja Virtual, n&amp;atilde;o se aplicando a outras vendas realizadas fora da Loja Virtual.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;As fotos e imagens da Loja Virtual podem n&amp;atilde;o refletir seu tamanho original, ilustrando o modelo dos produtos. Para mais informa&amp;ccedil;&amp;otilde;es, clique em &amp;quot;detalhes&amp;quot;.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify; &quot;&gt;\r\n	&lt;strong&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;Formas de pagamento&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;Temos como parceiro &amp;uacute;nicos e exclusivos os servi&amp;ccedil;os digitais de pagamentos &lt;strong&gt;&lt;em&gt;PAGAMENTODIGITAL&lt;/em&gt;&lt;/strong&gt; do Grupo Buscap&amp;eacute;. &amp;Agrave; vista - Dep&amp;oacute;sito em conta ou Boleto Banc&amp;aacute;rio, Parcelado &amp;ndash; Atrav&amp;eacute;s do pagamentodigital.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;strong&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;Frete&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\r\n	&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;O frete &amp;eacute; de responsabilidade do usu&amp;aacute;rio, sendo que o valor (no caso de PAC ou Sedex) ser&amp;aacute; acrescido ao valor total da venda junto ao CARRINHO e no processamento da mesma.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;As op&amp;ccedil;&amp;otilde;es de entregas s&amp;atilde;o: PAC, SEDEX.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;Ap&amp;oacute;s o envio do pedido, nossa equipe da Central de Atendimento e de nosso sistema &amp;nbsp;entrar&amp;aacute; em contato para confirmar e acompanhar o pedido.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;Pedidos realizados fora do hor&amp;aacute;rio de expediente ser&amp;atilde;o confirmados posteriormente em hor&amp;aacute;rio comercial.&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;As mercadorias ser&amp;atilde;o enviadas em hor&amp;aacute;rio comercial.&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: ''Times New Roman''; text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; &quot;&gt;O endere&amp;ccedil;o de entrega dos produtos ser&amp;aacute; aquele que foi cadastrado no sistema.&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify; &quot;&gt;\r\n	&lt;font face=&quot;tahoma, geneva, sans-serif&quot;&gt;Muito de nossos produtos s&amp;atilde;o feitos de forma artezanal, porntato damos um prazo de 15 a 45 dias para entrega dos mesmos.&lt;/font&gt;&lt;/p&gt;\r\n'),
(4, 2, 'Quem somos', '&lt;p style=&quot;text-align: justify&quot;&gt;\r\n	&lt;a href=&quot;http://laramara.org.br/portugues/index.php&quot;&gt;http://laramara.org.br/portugues/index.php&lt;/a&gt;&lt;/p&gt;\r\n'),
(6, 2, 'Frete e Devoluções', '&lt;p&gt;\r\n	&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; font-size: 14px; line-height: 20px; text-align: justify; &quot;&gt;Para informa&amp;ccedil;&amp;otilde;es sobre devolu&amp;ccedil;&amp;otilde;es e frete favor ligar para (11)3660-6463 ou pelo e-mail&amp;nbsp;&lt;/span&gt;&lt;a href=&quot;mailto:lojavirutal@laramara.orb.br&quot; style=&quot;font-family: tahoma, geneva, sans-serif; font-size: 14px; line-height: 20px; text-align: justify; color: rgb(0, 0, 0); text-decoration: none; &quot;&gt;lojavirtual@laramara.org.br&lt;/a&gt;&lt;/p&gt;\r\n'),
(7, 2, 'PRAZO PARA PEDIDOS 2013', '&lt;p style=&quot;text-align: center&quot;&gt;\r\n	&lt;span _fck_bookmark=&quot;1&quot; style=&quot;display: none&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span _fck_bookmark=&quot;1&quot; style=&quot;display: none&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 22px&quot;&gt;O NATAL ESTA CHEGANDO, ANTECIPE SUAS COMPRAS. PEDIDOS ACEITOS AT&amp;Eacute; 15/12/2013&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center&quot;&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;em&gt;&lt;strong&gt;&lt;span style=&quot;background-color: #d3d3d3&quot;&gt;&lt;span style=&quot;color: #000&quot;&gt;&lt;img align=&quot;middle&quot; alt=&quot;&quot; height=&quot;1200&quot; src=&quot;http://lojavirtual.laramara.org.br/image/data/nata.jpg&quot; width=&quot;1920&quot; /&gt;&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span _fck_bookmark=&quot;1&quot; style=&quot;display: none&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span _fck_bookmark=&quot;1&quot; style=&quot;display: none&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n');

