--
-- Estrutura da tabela `oc_product_description`
--

DROP TABLE IF EXISTS `oc_product_description`;
CREATE TABLE IF NOT EXISTS `oc_product_description` (
  `product_id` int(11) NOT NULL AUTO_INCREMENT,
  `language_id` int(11) NOT NULL,
  `name` varchar(255) COLLATE utf8_bin NOT NULL,
  `meta_keywords` varchar(255) COLLATE utf8_bin NOT NULL,
  `meta_description` varchar(255) COLLATE utf8_bin NOT NULL,
  `description` text COLLATE utf8_bin NOT NULL,
  PRIMARY KEY (`product_id`,`language_id`),
  KEY `name` (`name`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_bin AUTO_INCREMENT=204 ;

--
-- Extraindo dados da tabela `oc_product_description`
--

INSERT DELAYED IGNORE INTO `oc_product_description` (`product_id`, `language_id`, `name`, `meta_keywords`, `meta_description`, `description`) VALUES
(1, 2, 'Chocalho gruda-gruda', '', '', '&lt;p&gt;\r\n	Brinquedo composto por dois potes cil&amp;iacute;ndricos, medindo 10 cm de altura e 7 de di&amp;acirc;metro, forrados com tecidos diferentes na cor e na textura. Os chocalhos cont&amp;ecirc;m em seu interior objetos diferentes, assim produzem sons diferentes. Ambos possuem, no sentido vertical, uma faixa de velcro que prende um ao outro.&lt;/p&gt;\r\n'),
(3, 2, 'Chocalho ouro-prata', '', '', '&lt;p&gt;\r\n	Brinquedo composto por dois potes cil&amp;iacute;ndricos medindo 10 cm de altura e 7 de di&amp;acirc;metro, forrados com tecidos de cores fortes, dourado e prateado, com texturas diferentes. O chocalho prateado, forrado com tecido de textura bem lisa, traz dentro algumas pedras e &amp;eacute; bem pesado. O chocalho dourado, forrado com tecido de textura &amp;aacute;spera, possui dentro algumas moedas e &amp;eacute; mais leve.&lt;/p&gt;\r\n'),
(4, 2, 'Pulseirinha', '', '', '&lt;p&gt;\r\n	Duas pulseiras feitas de contas redondas, de v&amp;aacute;rias cores, enfiadas em um el&amp;aacute;stico redondo fino, intercaladas com quatro guizos.&lt;/p&gt;\r\n'),
(6, 2, 'Chocalho sensorial', '', '', '&lt;p&gt;\r\n	Chocalho de forma cil&amp;iacute;ndrica medindo 10 cm de altura e 7 de di&amp;acirc;metro, forrado com tecido em cores de alto contraste, preto e branco, contendo em seu interior objetos que produzem som como, por exemplo, arroz.&lt;/p&gt;\r\n'),
(7, 2, 'Capa de mamadeira', '', '', '&lt;p&gt;\r\n	Capa de croch&amp;ecirc; com listras alternadas em preto e branco.&lt;/p&gt;\r\n'),
(8, 2, 'Meia careta', '', '', '&lt;p&gt;\r\n	Meia de tamanho pequeno, vermelha, tendo na ponta um pompom amarelo. Na parte correspondente &amp;agrave; planta do p&amp;eacute;, est&amp;atilde;o presos 3 guizos, colocados a alguma dist&amp;acirc;ncia um do outro.&lt;/p&gt;\r\n'),
(128, 2, 'Dama e Trilha', '', '', '&lt;p&gt;\r\n	&lt;b&gt;Dama&lt;/b&gt;&lt;br /&gt;\r\n	Tabuleiro de dama em madeira (modelo padr&amp;atilde;o), com velcro (macho) colado nos quadrados pretos. Cont&amp;eacute;m 24 pe&amp;ccedil;as em EVA com texturas (12 com lixa e 12 lisas) e 12 damas (pe&amp;ccedil;as duplas coladas, sendo 6 com lixa e 6 lisas). Todas as pe&amp;ccedil;as possuem velcro (f&amp;ecirc;mea) colado na parte de baixo para que sejam fixadas no tabuleiro.&lt;br /&gt;\r\n	&lt;b&gt;Trilha&lt;/b&gt;&lt;br /&gt;\r\n	Tabuleiro de trilha em madeira (modelo padr&amp;atilde;o), com 24 pontos circulares nos quais s&amp;atilde;o colados velcro (macho) e um ponto &amp;eacute; ligado ao outro por tiras de lixa coladas. Cont&amp;eacute;m 18 pe&amp;ccedil;as (9 com feltro e 9 lisas), com velcro (f&amp;ecirc;mea) colado na parte de baixo para que sejam fixadas no tabuleiro.&lt;/p&gt;\r\n'),
(9, 2, 'Sexteto em cores', '', '', '&lt;p&gt;\r\n	Painel de papel&amp;atilde;o, medindo 50x40 cm. No painel est&amp;atilde;o colados 6 quadrados de papel&amp;atilde;o de 15x15 cm com figuras coloridas e atraentes: carro, bola, ma&amp;ccedil;&amp;atilde;, cara, casa e barco. As figuras est&amp;atilde;o coladas em duas linhas horizontais de 3 figuras cada uma. Todo o conjunto &amp;eacute; plastificado. Acompanham mais 6 quadrados com a mesma medida e as mesmas figuras do painel, plastificados e colocados em um envelope.&lt;/p&gt;\r\n'),
(10, 2, 'Multiquadros', '', '', '&lt;p&gt;\r\n	Painel feito em tecido macio, acolchoado, medindo 64 x 82 cm, composto de nove ret&amp;acirc;ngulos de cores vivas medindo 17 x 20 cm. Cada ret&amp;acirc;ngulo tem uma atraente e interessante figura de animal, brinquedo ou objeto. Alguns dos ret&amp;acirc;ngulos possuem partes remov&amp;iacute;veis ou sonoras: um peixinho que pode ser retirado do aqu&amp;aacute;rio, as rodas de um carro que giram, a tv com bot&amp;otilde;es que podem ser rodados, o relevo encontrado na casca do abacaxi, uma bola que produz som quando apertada, uma ave com asas soltas, uma tartaruga presa com velcro.&lt;/p&gt;\r\n'),
(11, 2, 'Cubos de alto contraste', '', '', '&lt;p&gt;\r\n	Cubos feitos de espuma, revestidos de tecidos em padr&amp;otilde;es de alto contraste, preto e branco, medindo 12 cm de lado. S&amp;atilde;o tr&amp;ecirc;s cubos sendo um deles de listras, o outro xadrez e o &amp;uacute;ltimo de bolas. Os cubos possuem nas laterais faixas de velcro que prendem um ao outro. No interior do cubo existe um guizo que produz som quando ele &amp;eacute; movimentado.&lt;/p&gt;\r\n'),
(126, 2, 'Jogo da velha', '', '', '&lt;p&gt;\r\n	Tabuleiro feito de EVA nas cores preto e vermelho, medindo 32 x 32 cm, com recorte em &amp;acirc;ngulo do lado direito superior. Possui 3 colunas com 3 quadrados em cada uma, medindo 10,2 cm divididos por tiras de 0,5 cm de espessura. Cont&amp;eacute;m 5 c&amp;iacute;rculos de EVA amarelos de 8 cm de di&amp;acirc;metro e 5 pe&amp;ccedil;as vermelhas no formato de X, medindo 7 x 7 cm.&lt;/p&gt;\r\n'),
(12, 2, 'Painel de cores e formas', '', '', '&lt;p&gt;\r\n	Painel feito em tecido macio, acolchoado, medindo 100 x 80 cm, composto por 20 quadrados de 20 cm, nas cores vermelha, amarela, azul, e verde. No centro de cada quadrado est&amp;aacute; preso um objeto, letra ou n&amp;uacute;mero e de cada tipo existem 2 objetos iguais em uso e fun&amp;ccedil;&amp;atilde;o, mas de tamanho e cor diferentes e feitos de diferentes materiais. Os objetos iguais est&amp;atilde;o colocados em quadrados de mesma cor.&lt;/p&gt;\r\n'),
(13, 2, 'Trio em preto e branco', '', '', '&lt;p&gt;\r\n	Kit contendo tr&amp;ecirc;s almofadas, recheadas de material leve e macio, medindo cada uma 25 x 35 cm. Revestidas em tecido de algod&amp;atilde;o, em padr&amp;otilde;es de alto contraste, preto e branco, sendo uma listrada, a outra xadrez e a &amp;uacute;ltima de bolas.&lt;/p&gt;\r\n'),
(14, 2, 'Luva color', '', '', '&lt;p&gt;\r\n	Luva confeccionada em tecido brilhante ou de cor viva com uma careta desenhada na palma da m&amp;atilde;o.&lt;/p&gt;\r\n'),
(15, 2, 'Portátil', '', '', '&lt;p&gt;\r\n	Sacola feita de tecido macio, acolchoado, medindo 50 x 50 cm (quando aberta 100 x 50 cm) tendo estampados na face externa 8 quadrados: 2 vermelhos, 2 azuis, 2 amarelos e 2 verdes. Na face interna da sacola temos, em uma metade, um tabuleiro de damas e, na outra, um jogo da velha. Acompanha uma sacola com pedras de dama e jogo da velha (para serem usadas na face interna) e formas geom&amp;eacute;tricas (para serem colocadas sobre as figuras estampadas na face externa da sacola). A sacola &amp;eacute; fechada nas laterais por bot&amp;otilde;es e, quando aberta, transforma-se em um tapetinho.&lt;/p&gt;\r\n'),
(76, 2, 'Larabraille', '', '', '&lt;p&gt;\r\n	Brinquedo composto de uma prancheta de madeira medindo 22 x 9 cm, com pequenos furos agrupados de 6 em 6, reproduzindo a cela braille. Acompanham 102 pequenos pinos met&amp;aacute;licos sem ponta. Acompanha o alfabeto braille.&lt;/p&gt;\r\n'),
(123, 2, 'Lingua do P', '', '', '&lt;p&gt;\r\n	Pote de pl&amp;aacute;stico redondo com tampa com 27 cm de di&amp;acirc;metro e 14 de altura. Na tampa do pote est&amp;aacute; colado um ret&amp;acirc;ngulo de 8 x 14 cm com seis orif&amp;iacute;cios, representando a cela braille. Um pequeno corte identifica o canto superior direito do ret&amp;acirc;ngulo. Acompanham seis pequenos c&amp;iacute;rculos que podem ser encaixados nos orif&amp;iacute;cios e servem para formar uma letra em braille. Para crian&amp;ccedil;as com vis&amp;atilde;o, utilizar letras comuns feitas de pl&amp;aacute;stico ou de papel&amp;atilde;o. No interior do pote encontram-se objetos diferentes, feitos de materiais variados, cujos nomes iniciam pela letra P. S&amp;atilde;o objetos simples, do dia-a-dia da crian&amp;ccedil;a. Acompanha o alfabeto braille.&lt;/p&gt;\r\n'),
(18, 2, 'Ciranda das cores', '', '', '&lt;p&gt;\r\n	Painel circular, feito de tecido macio, acolchoado, alegre e colorido, com 80 cm de di&amp;acirc;metro. Possui em toda a volta 12 bolsos nas seguintes cores: amarelo, azul, verde e vermelho, intercaladas. Em cada bolso h&amp;aacute; um objeto de uso comum da crian&amp;ccedil;a ou brinquedo sobre o qual ela possa agir: pentear, cortar, dar corda, apertar; um deles &amp;eacute; sonoro. A figura de cada brinquedo est&amp;aacute; estampada na frente do respectivo bolso. O painel possui duas al&amp;ccedil;as e, quando dobrado, vira uma bolsa.&lt;/p&gt;\r\n'),
(21, 2, 'Amassadinha', '', '', '&lt;p&gt;\r\n	Brinquedo composto de uma pequena bexiga de borracha colorida, recheada de farinha de trigo, formando uma bola. Esta bola &amp;eacute; muito flex&amp;iacute;vel e, ao ser apertada, muda totalmente de forma. Em uma das faces da bola est&amp;atilde;o colocados elementos que imitam olhos, nariz e boca. Na parte superior fios de l&amp;atilde; imitam os cabelos, amarelos ou pretos, mais longos ou mais curtos.&lt;/p&gt;\r\n'),
(22, 2, 'Rodão', '', '', '&lt;p&gt;\r\n	Material composto de uma c&amp;acirc;mara-de-ar cheia, medindo 140 cm de di&amp;acirc;metro, revestida de tecido de tric&amp;ocirc;, de 4 cores: vermelho, azul, amarelo e verde. Na parte de cima do rod&amp;atilde;o est&amp;atilde;o presos, com el&amp;aacute;stico de 15 cm de comprimento, diferentes objetos e brinquedos: bola, escova de cabelo, caneca, esponja de banho, sanfona, pandeiro, corneta, embalagem de desodorante e bolsa com z&amp;iacute;per. Os el&amp;aacute;sticos podem ser colocados e retirados com facilidade, para que os objetos n&amp;atilde;o sejam usados todos ao mesmo tempo. Um pequeno travesseiro serve de encosto para a crian&amp;ccedil;a.&lt;/p&gt;\r\n'),
(23, 2, 'Bola baby', '', '', '&lt;p&gt;\r\n	Bola pequena, macia e agrad&amp;aacute;vel ao tato, cujo revestimento &amp;eacute; feito de quatro tecidos diferentes na cor e na textura: vermelho, branco, com listas pretas e brancas e, o &amp;uacute;ltimo preto, com bolas brancas. No interior da bolinha existe um guizo.&lt;/p&gt;\r\n'),
(24, 2, 'Dentro d''agua', '', '', '&lt;p&gt;\r\n	Brinquedo composto de uma prancheta de 44,5 x 12 cm feita de material leve e macio, tendo uma face azul e outra amarela. Na face azul existem quatro cavidades onde se encaixam 4 peixes amarelos com textura diferente daquela da prancheta, todos de forma exatamente igual mas de tamanhos variados. Os peixes, quando encaixados, ficam em relevo.&lt;/p&gt;\r\n'),
(25, 2, 'Parabólicos', '', '', '&lt;p&gt;\r\n	Brinquedo composto de dois macac&amp;otilde;es feitos de tecido pluma, leve e macio, em duas cores diferentes, bem vivas, com algumas aplica&amp;ccedil;&amp;otilde;es de cor branca, com bastante contraste. Acompanham duas bolas pretas revestidas de velcro.&lt;/p&gt;\r\n'),
(26, 2, 'Cole-ball', '', '', '&lt;p&gt;\r\n	Brinquedo composto de dois coletes feitos de tecido de nylon, um preto e outro azul. Na parte das costas encontramos faixas de velcro coloridas. Na frente temos figuras de cinco frutas diferentes. Acompanham duas bolas brancas, recobertas de tecido pluma.&lt;/p&gt;\r\n'),
(27, 2, 'Doce sabor', '', '', '&lt;p&gt;\r\n	Brinquedo composto de uma caixa de pl&amp;aacute;stico medindo 35x19 cm. Um peda&amp;ccedil;o de doce (gelatina) colorido medindo.&lt;br /&gt;\r\n	Um bast&amp;atilde;o de pirulito de 15 cm de comprimento para ser colocado no centro do doce.&lt;br /&gt;\r\n	24 balas de forma circular com um furo central, de cores variadas.&lt;br /&gt;\r\n	1 tubo de pastilhas de menta de cor branca, de forma circular, com um furo central.&lt;br /&gt;\r\n	1 metro de fio de nylon.&lt;br /&gt;\r\n	2 caixas de gelatina em p&amp;oacute; de sabores diferentes.&lt;br /&gt;\r\n	3 envelopes de ksuco de sabores diferentes.&lt;br /&gt;\r\n	1 pacotinho de bolacha redonda com furo central.&lt;br /&gt;\r\n	1 pacotinho de farinha de trigo.&lt;br /&gt;\r\n	1 receita de tinta de gelatina.&lt;br /&gt;\r\n	1 receita de massinha colorida.&lt;/p&gt;\r\n'),
(28, 2, 'Rolinho', '', '', '&lt;p&gt;\r\n	Rolo feito de tecido atoalhado ou de uma toalha de banho enrolada, com aproximadamente 14 cm de di&amp;acirc;metro e 50 de comprimento. Este rolo &amp;eacute; acolchoado com espuma e revestido de tecido colorido, arrematado nas duas pontas por la&amp;ccedil;os de fitas coloridas nos quais se prende um guizo.&lt;/p&gt;\r\n'),
(29, 2, 'Cubo geométrico', '', '', '&lt;p&gt;\r\n	Cubo feito de espuma, medindo 10 x 10 cm, leve e revestido de tecido macio. Em cada lado existe uma aplica&amp;ccedil;&amp;atilde;o de velcro onde se prende uma figura geom&amp;eacute;trica bidimensional feita em feltro colorido; s&amp;atilde;o 3 pares de figuras diferentes. No interior do cubo existe um guizo que produz som.&lt;/p&gt;\r\n'),
(30, 2, 'Frutíferas', '', '', '&lt;p&gt;\r\n	Uma prancheta de madeira de 37 x 26 cm, revestida na parte superior com material emborrachado, leve e macio, de cor amarela. No material emborrachado h&amp;aacute; tr&amp;ecirc;s cavidades onde se encaixam tr&amp;ecirc;s figuras de &amp;aacute;rvores, de formas iguais, mas de tamanhos diferentes. Nas figuras est&amp;atilde;o recortados pequenos c&amp;iacute;rculos de cor laranja, com textura diferente da &amp;aacute;rvore: cinco c&amp;iacute;rculos na &amp;aacute;rvore maior, quatro na m&amp;eacute;dia e tr&amp;ecirc;s na pequena; os c&amp;iacute;rculos imitam frutas e t&amp;ecirc;m tamanhos variados, de acordo com a &amp;aacute;rvore onde ficam. As &amp;aacute;rvores, quando encaixadas, ficam em relevo.&lt;/p&gt;\r\n'),
(33, 2, 'Cocos decorados', '', '', '&lt;p&gt;\r\n	Brinquedo composto de duas metades da casca de um coco, decoradas na parte externa com pap&amp;eacute;is coloridos. A parte interna &amp;eacute; forrada com espuma para aumentar a espessura e ficar macia. Os dois lados da borda s&amp;atilde;o furados para que se passe um cord&amp;atilde;o por eles. Dois cord&amp;otilde;es de 15 cm para prender o brinquedo no bra&amp;ccedil;o da crian&amp;ccedil;a.&lt;/p&gt;\r\n'),
(34, 2, 'Body-ball (Quadro Menina)', '', '', '&lt;p&gt;\r\n	Brinquedo composto por um painel de madeira, de cor branca, medindo 85 cm de altura e 62 de largura. Sobre o painel est&amp;aacute; colado a figura de uma menina ou um menino com a mesma altura do painel. A figura de tecido pluma, t&amp;ecirc;m roupas de cores fortes, sapatos e meias, tudo feito com o mesmo tecido. Os bonecos possuem cabelos sendo o da menina destacado do painel e amarrado com fita. Acompanha uma bolinha de cor preta com elementos de velcro que facilitam a ader&amp;ecirc;ncia ao tecido de pluma dos bonecos.&lt;/p&gt;\r\n'),
(36, 2, 'Forme formas', '', '', '&lt;p&gt;\r\n	Material composto de 6 placas retangulares medindo 26 x 20 cm, feitas de material leve e macio, de cor azul. Cada placa cont&amp;eacute;m orif&amp;iacute;cios que formam uma figura geom&amp;eacute;trica: c&amp;iacute;rculo, quadrado, ret&amp;acirc;ngulo, tri&amp;acirc;ngulo, estrela e oval; Acompanham 80 pinos que, encaixados, formam a figura em relevo.&lt;/p&gt;\r\n'),
(37, 2, 'Livro das grandezas', '', '', '&lt;p&gt;\r\n	Livro feito em tecido macio, feltro colorido, medindo 30 x 25 cm, possuindo 10 folhas incluindo a capa, presas com um la&amp;ccedil;o de fita. Cada folha cont&amp;eacute;m elementos concretos, bidimensionais, que mostram formas e grandezas diferentes: comprimento, largura, altura e grossura. Cont&amp;eacute;m z&amp;iacute;peres e la&amp;ccedil;o de fita que ajudam no aprendizado das atividades de vida di&amp;aacute;ria e desenvolvem a coordena&amp;ccedil;&amp;atilde;o motora.&lt;/p&gt;\r\n'),
(40, 2, 'Prancheta geométrica', '', '', '&lt;p&gt;\r\n	Prancheta feita de material leve e macio, de forma retangular, medindo 80 x 25 cm, de cor preta. Quatro caixas de cores diferentes de aproximadamente 15 cm, nas formas de : c&amp;iacute;rculo, ret&amp;acirc;ngulo , tri&amp;acirc;ngulo , quadrado Acompanha um recipiente redondo com tampa, cheio de placas recortadas nas mesmas quatro formas geom&amp;eacute;tricas, em diferentes cores e texturas, sendo algumas vazadas.&lt;/p&gt;\r\n'),
(41, 2, 'Cubo surpresa', '', '', '&lt;p&gt;\r\n	Material composto por seis placas quadradas, com 32 cm de lado, feitas de material de cores variadas. As placas se encaixam formando um cubo. Em duas placas existem aberturas redondas onde a crian&amp;ccedil;a pode introduzir as m&amp;atilde;os. No interior do cubo existem 10 c&amp;iacute;rculos, formando 5 pares de c&amp;iacute;rculos com diferentes texturas.&lt;/p&gt;\r\n'),
(42, 2, 'Encaixando', '', '', '&lt;p&gt;\r\n	Material composto por 7 potes cil&amp;iacute;ndricos, com 24 cm de altura, tampados, cada um contendo pequenos objetos diferentes entre si, ex: bolinhas de gude, apitos, pi&amp;atilde;o, chaves, pedras, pilhas pequenas, tampinhas de garrafa, conchas e bot&amp;otilde;es. Os potes s&amp;atilde;o revestidos por diferentes materiais: feltro, corti&amp;ccedil;a, papel ondulado, pl&amp;aacute;stico com bolinhas, emborrachado, soft e lixa. Outros 7 potes cil&amp;iacute;ndricos, bem mais baixos e com um di&amp;acirc;metro maior que os anteriores, com 13 cm de altura, sem tampa, revestidos com os mesmos materiais citados anteriormente.&lt;/p&gt;\r\n'),
(43, 2, 'Tampadinhas', '', '', '&lt;p&gt;\r\n	Painel feito de tecido de nylon azul, acolchoado, medindo 100 cm de comprimento por 50 de largura. O painel tem al&amp;ccedil;as nos lados mais estreitos, transformando-se em uma sacola fechada por velcro nas laterais. Traz um gancho em forma de cabide por onde ser&amp;aacute; pendurado. Encontram-se no painel pequenos envelopes de pl&amp;aacute;stico onde ser&amp;atilde;o encaixados cart&amp;otilde;es com os nomes dos meses do ano, dias da semana e dias do m&amp;ecirc;s. Em outros envelopes situados ao lado dos anteriores ser&amp;atilde;o encaixados cart&amp;otilde;es com nomes de datas festivas ou datas importantes para a crian&amp;ccedil;a. Outros envelopes permitem que a crian&amp;ccedil;a coloque cart&amp;otilde;es referentes a atividades que ela desenvolve nos diferentes dias de semana. Todos os cart&amp;otilde;es s&amp;atilde;o escritos em braille e em letra comum. Na parte superior est&amp;aacute; o t&amp;iacute;tulo: meses do ano, dias da semana e, na parte inferior, dias do m&amp;ecirc;s. Material muito &amp;uacute;til para ajudar a crian&amp;ccedil;a na organiza&amp;ccedil;&amp;atilde;o temporal e na organiza&amp;ccedil;&amp;atilde;o de suas atividades nos v&amp;aacute;rios dias da semana.&lt;/p&gt;\r\n'),
(44, 2, 'Dominó de texturas', '', '', '&lt;p&gt;\r\n	Caixa contendo 28 ret&amp;acirc;ngulos de material emborrachado preto com 5x2,5 cm. Cada ret&amp;acirc;ngulo possui nas duas pontas um pequeno c&amp;iacute;rculo de cor e textura diferente.&lt;/p&gt;\r\n'),
(45, 2, 'Fofão', '', '', '&lt;p&gt;\r\n	Puf redondo, recoberto por faixas de tecido colorido sendo: vermelho nas laterais, amarelo e azul na frente, a parte posterior e o assento de couro branco. Todos os tecidos t&amp;ecirc;m textura diferente. Na parte da frente existem dois bolsos de pl&amp;aacute;stico transparente em que est&amp;atilde;o escritas as palavras direito e esquerdo em braille e letra comum. Os bolsos cont&amp;ecirc;m um par de chinelos. Nas laterais encontram-se bolsos pl&amp;aacute;sticos com v&amp;aacute;rios brinquedos. Ainda nas laterais, sobre os bolsos, encontramos duas al&amp;ccedil;as nas quais a crian&amp;ccedil;a pode segurar e se apoiar. O puf possui uma ponta superior na qual est&amp;aacute; pregada uma borla de l&amp;atilde; verde. Quando a crian&amp;ccedil;a senta-se sobre o puf ela forma um encosto.&lt;/p&gt;\r\n'),
(46, 2, 'Text form', '', '', '&lt;p&gt;\r\n	Material composto de placa feita de material leve e macio, de cor verde, medindo 36 x 27 cm, com 9 pinos dispostos em 3 fileiras horizontais. Acompanham 18 pe&amp;ccedil;as do mesmo material, recortadas em forma hexagonal, com um furo no meio. Um dos lados de cada pe&amp;ccedil;a &amp;eacute; recoberto por material de texturas e cores variadas, formando 9 pares de texturas diferentes.&lt;/p&gt;\r\n'),
(47, 2, 'Eu e o papai', '', '', '&lt;p&gt;\r\n	Material composto de duas almofadas de tamanhos, cores e texturas diferentes. Em uma das faces da almofada maior encontra-se um envelope de pl&amp;aacute;stico transparente onde deve ser encaixada a foto do papai. Na almofada menor tamb&amp;eacute;m encontra-se um envelope igual onde deve ser encaixada a foto do beb&amp;ecirc;. No interior das almofadas temos subst&amp;acirc;ncias arom&amp;aacute;ticas com aroma diferente em cada uma.&lt;/p&gt;\r\n'),
(49, 2, 'Imitando a mamãe', '', '', '&lt;p&gt;\r\n	Conjunto com 5 necessaire, cada uma de tamanho diferente. Dentro de cada bolsa encontra-se objetos utilizados pela Mam&amp;atilde;e em seu dia-a-dia. Ex: molho de chaves, caderneta, batom, caneta, espelho, pente...&lt;/p&gt;\r\n'),
(51, 2, 'Separando', '', '', '&lt;p&gt;\r\n	Brinquedo composto de prancheta feita de material leve e macio, medindo 40 x 40 cm na cor preta. Acompanham quatro potes de pl&amp;aacute;stico tampados, nas cores: amarelo, vermelho, azul e verde. Recipiente redondo de pl&amp;aacute;stico, contendo objetos de 4 tipos diferentes: conchas, moedas, pedras e bolas de gude.&lt;/p&gt;\r\n'),
(52, 2, 'Sacola de piscina', '', '', ''),
(53, 2, 'Tateando', '', '', '&lt;p&gt;\r\n	Tapete confeccionado em tecido colorido, macio, acolchoado, retangular, medindo 130 x 90 cm. Nele est&amp;atilde;o presos, com el&amp;aacute;stico de 15 cm de comprimento, diferentes objetos e brinquedos: argola, pente, peteca, bolsinha com z&amp;iacute;per contendo &amp;oacute;culos, caneca, escova de cabelo, esponja de banho, tubo de desodorante, ursinho de pel&amp;uacute;cia . O el&amp;aacute;stico facilita &amp;agrave; crian&amp;ccedil;a recuperar com facilidade os objetos.&lt;/p&gt;\r\n'),
(54, 2, 'Um, dois... feijão com arroz', '', '', '&lt;p&gt;\r\n	Brinquedo feito de material leve e macio, amarelo, reproduzindo as m&amp;atilde;os direita e esquerda. Na ponta dos dedos da m&amp;atilde;o esquerda est&amp;atilde;o os n&amp;uacute;meros de 1 a 5 iniciando no dedo m&amp;iacute;nimo. Na m&amp;atilde;o direita est&amp;atilde;o os n&amp;uacute;meros de 6 a 10 iniciando pelo polegar. Os n&amp;uacute;meros est&amp;atilde;o escritos em braille e em tinta.&lt;/p&gt;\r\n'),
(55, 2, 'Trincos e truques', '', '', '&lt;p&gt;\r\n	Prancha de madeira, retangular, medindo 30 x 21 cm. Na superf&amp;iacute;cie da prancha encontram-se 5 portas, com dobradi&amp;ccedil;as, cada uma delas com fechos diferentes: 3 tipos de trinco, chave, cadeado. Uma das portas tem puxador. Encontramos ainda uma trava de seguran&amp;ccedil;a para porta. Acompanha uma sacola com 7 r&amp;eacute;plicas de ferramentas, feitas de pl&amp;aacute;stico e 4 parafusos pl&amp;aacute;sticos. Faz parte tamb&amp;eacute;m uma placa de encartex onde podem ser encaixados parafusos verdadeiros em tamanhos variados.&lt;/p&gt;\r\n'),
(56, 2, 'Pareando objetos', '', '', '&lt;p&gt;\r\n	Material composto de uma caixa de madeira amarela, retangular, medindo 80 cm de comprimento, 40 de largura e 12,5 de altura dividida em 18 compartimentos iguais, dispostos em 3 fileiras horizontais de 6 compartimentos cada. Acompanham 18 tipos diferentes de objetos. Colocamos 2 ou 3 objetos de cada tipo, feitos com material diferente, tendo tamanhos diferentes, por&amp;eacute;m com o mesmo uso e fun&amp;ccedil;&amp;atilde;o. Os objetos s&amp;atilde;o acomodados em um recipiente redondo.&lt;/p&gt;\r\n'),
(57, 2, 'Kit de higiene', '', '', '&lt;p&gt;\r\n	Material composto de uma prancheta feita de material leve e agrad&amp;aacute;vel ao tato, com 15 X 13 cm, tendo uma superf&amp;iacute;cie rebaixada onde se encaixa uma plaqueta com o nome de um objeto. Acompanham quatro plaquetas, cada uma com o nome de um objeto diferente escrito em braille. Um pequeno corte identifica o canto superior direito. Fazem parte do kit quatro objetos cujos nomes est&amp;atilde;o colocados nas plaquetas e que s&amp;atilde;o familiares &amp;agrave; crian&amp;ccedil;a por pertencerem &amp;agrave;s suas atividades di&amp;aacute;rias de higiene.&lt;/p&gt;\r\n'),
(58, 2, 'Feirinha', '', '', '&lt;p&gt;\r\n	Sacola de nylon, medindo 34 x 38 cm, pr&amp;oacute;pria para fazer compras na feira. Em seu interior encontram-se r&amp;eacute;plicas feitas de pl&amp;aacute;stico de frutas e legumes, sendo 18 frutas e 10 legumes.&lt;/p&gt;\r\n'),
(59, 2, 'Pré bengala', '', '', '&lt;p&gt;\r\n	Brinquedo em forma de raquete, confeccionado a partir de um bambol&amp;ecirc; que &amp;eacute; dobrado, amarrado e preso com fita adesiva, formando um cabo. Deve ter cor forte e alegre: vermelha, amarela. No interior do tubo colocam-se bolas ou objetos que produzem som.&lt;/p&gt;\r\n'),
(61, 2, 'Brincando de mamãe', '', '', '&lt;p&gt;\r\n	Painel de tecido macio, acolchoado e agrad&amp;aacute;vel ao tato, medindo 100 x 80 cm. Na superf&amp;iacute;cie do painel, est&amp;atilde;o presos elementos que incentivam as brincadeiras e despertam a curiosidade das crian&amp;ccedil;as, ajudando-as no aprendizado das atividades de higiene, alimenta&amp;ccedil;&amp;atilde;o e vestu&amp;aacute;rio. Na parte superior do painel, encontram-se dois bonequinhos de pano, que representam um menino e uma menina. Eles podem ser removidos do painel e sua roupa pode ser retirada. Brincando com os bonecos, as crian&amp;ccedil;as podem realizar atividades como: dar la&amp;ccedil;o, fechar e abrir fivela, fechar com velcro, abotoar etc. Entre os dois bonecos h&amp;aacute; um envelope de pl&amp;aacute;stico contendo um prato, uma colher e uma caneca. Na parte inferior existem tr&amp;ecirc;s bolsos onde est&amp;atilde;o colocados objetos usados na higiene: esponja, sabonete, pasta de dente, talco, xampu, desodorante, pente, escova de dente e de cabelo e toalha.&lt;/p&gt;\r\n'),
(62, 2, 'Pra boiar', '', '', '&lt;p&gt;\r\n	Placas recortadas em material leve e agrad&amp;aacute;vel ao tato, nas formas de caranguejo e estrela do mar, medindo aproximadamente 20 cm, sendo uma amarela e outra azul. No centro de cada placa existe um orif&amp;iacute;cio onde pode ser encaixado um copo. O material usado permite que as placas b&amp;oacute;iem na &amp;aacute;gua.&lt;/p&gt;\r\n'),
(63, 2, 'Bolsões', '', '', '&lt;p&gt;\r\n	Avental confeccionado em tecido amarelo, tendo na frente dois bolsos nas cores azul e vermelha. Os bolsos cont&amp;ecirc;m objetos que s&amp;atilde;o utilizados na higiene: sabonete, esponja, toalha, pente, escova de cabelo, talco, desodorante, pasta e escova de dente.&lt;/p&gt;\r\n'),
(64, 2, 'Prancha de alimentação', '', '', '&lt;p&gt;\r\n	Prancha retangular, feita de material leve, macio e agrad&amp;aacute;vel ao tato, medindo 42 x 34 cm. A prancha &amp;eacute; preta, lisa e os elementos que representam o prato, o copo e os talheres s&amp;atilde;o amarelos, recortados e feitos de material com textura granulosa; as figuras recortadas do prato, copo e talheres poder&amp;atilde;o ser removidas e facilmente recolocadas. A textura e a cor desses elementos destac&amp;aacute;veis s&amp;atilde;o diferentes e contrastam bastante com a prancheta.&lt;/p&gt;\r\n'),
(124, 2, 'Livro sensorial - vol. 01 e 02', '', '', '&lt;p&gt;\r\n	Livro composto de sessenta p&amp;aacute;ginas, em dois volumes, medindo 36 x 22 cm, com duzentas e quatro figuras em relevo. As figuras s&amp;atilde;o feitas de materiais bem variados: espuma, tecido, madeira, pl&amp;aacute;stico, barbante, material emborrachado e outros. As figuras s&amp;atilde;o coloridas e o livro &amp;eacute; atraente tamb&amp;eacute;m para as crian&amp;ccedil;as que enxergam. O livro possui um kit com figuras recortadas que possibilita &amp;agrave; crian&amp;ccedil;a representar cenas que ilustrem hist&amp;oacute;rias por ela criadas, aplicando os conhecimentos adquiridos. A &amp;uacute;ltima folha do livro &amp;eacute; uma tela de nylon que permite &amp;agrave; crian&amp;ccedil;a fazer representa&amp;ccedil;&amp;otilde;es gr&amp;aacute;ficas em relevo, bastando para isso usar uma folha de papel sobre a tela e uma caneta sem ponta.&lt;/p&gt;\r\n'),
(67, 2, 'Alphaímã', '', '', '&lt;p&gt;\r\n	Placa retangular imantada medindo 12 x 8cm Acompanham 6 bot&amp;otilde;es coloridos, imantados, de forma circular Acompanha o alfabeto braille.&lt;/p&gt;\r\n'),
(68, 2, 'Pro banho', '', '', '&lt;p&gt;\r\n	Peixe feito de material leve e agrad&amp;aacute;vel ao tato, nas cores laranja e amarelo, medindo 20 cm de comprimento. Na parte mais larga possui furos e nas laterais existem bordas que permitem a coloca&amp;ccedil;&amp;atilde;o de um sabonete. O material usado permite que o peixe b&amp;oacute;ie na &amp;aacute;gua.&lt;/p&gt;\r\n'),
(78, 2, 'Brailindo', '', '', '&lt;p&gt;\r\n	Brinquedo composto de uma r&amp;eacute;gua feita de material leve e macio, medindo 25 x 5 cm. Acompanham 32 pinos coloridos. Acompanha alfabeto braille.&lt;/p&gt;\r\n'),
(79, 2, 'Pro Pé', '', '', '&lt;p&gt;\r\n	Chinelo feito de material leve, macio e colorido, com a cara de um bichinho. Apresenta&amp;ccedil;&amp;atilde;o em 3 tamanhos: pequeno, m&amp;eacute;dio e grande.&lt;/p&gt;\r\n'),
(77, 2, 'Tato e Tati', '', '', '&lt;p&gt;\r\n	Bonequinhos representando uma menina e um menino, ela de cabelo comprido e loiro, ele de cabelo curto e escuro, vestidos de macac&amp;atilde;o azul e amarelo. O macac&amp;atilde;o possui bolso, bot&amp;atilde;o, cinto com fivela e abotoamento com velcro nas costas. O sapato &amp;eacute; amarrado com cadar&amp;ccedil;o e la&amp;ccedil;o.&lt;/p&gt;\r\n'),
(82, 2, 'Para classificar', '', '', '&lt;p&gt;\r\n	Brinquedo composto de uma prancheta quadrada, de 32 cm de lado, feita de material leve e macio, com uma das faces vermelha e a outra amarela. Acompanham 10 pequenas placas de 3 x 2 cm, cada uma delas imitando uma cela braille, sendo quatro delas com o sinal de n&amp;uacute;mero e as outras representando um n&amp;uacute;mero de 1 a 6. Constam ainda do material 24 exemplares de quatro diferentes tipos de objetos, sendo seis pe&amp;ccedil;as de cada tipo. Acompanha tamb&amp;eacute;m um recipiente de pl&amp;aacute;stico redondo&lt;/p&gt;\r\n'),
(83, 2, 'Mini alphabraille', '', '', '&lt;p&gt;\r\n	Brinquedo composto de uma placa retangular feita de material leve e macio medindo 14,5 x 10 cm. Nesta placa est&amp;atilde;o recortados 8 ret&amp;acirc;ngulos que medem 5 x 3 cm. Na superf&amp;iacute;cie dos ret&amp;acirc;ngulos existem 6 orif&amp;iacute;cios reproduzindo a cela braille. Acompanham 32 pinos de pl&amp;aacute;stico colorido para serem encaixados nos orif&amp;iacute;cios e formar a letra braille. Acompanha o alfabeto braille.&lt;/p&gt;\r\n'),
(84, 2, 'Uni duni tê', '', '', '&lt;p&gt;\r\n	Brinquedo feito de material leve e macio, amarelo, reproduzindo as m&amp;atilde;os direita e esquerda. Na ponta dos dedos da m&amp;atilde;o esquerda est&amp;atilde;o os n&amp;uacute;meros de 1 a 5 iniciando no dedo m&amp;iacute;nimo. Na m&amp;atilde;o direita est&amp;atilde;o os n&amp;uacute;meros de 6 a 10 iniciando pelo polegar. Os n&amp;uacute;meros est&amp;atilde;o escritos em braille e em tinta.&lt;/p&gt;\r\n'),
(85, 2, 'Pé ante pé', '', '', '&lt;p&gt;\r\n	Brinquedo feito de material leve e macio, representando 5 pares de p&amp;eacute;s, um par de cada cor: vermelho, azul, amarelo, verde e laranja. Nos p&amp;eacute;s est&amp;atilde;o inscritos os n&amp;uacute;meros de 1 a 10 de tal forma que de cada cor existe um n&amp;uacute;mero par e um &amp;iacute;mpar. Os n&amp;uacute;meros est&amp;atilde;o em braille e em tinta.&lt;/p&gt;\r\n'),
(86, 2, 'Alphabraille', '', '', '&lt;p&gt;\r\n	Brinquedo composto de 12 ret&amp;acirc;ngulos feitos de material leve e macio, medindo cada um 8 x14 cm. Cada ret&amp;acirc;ngulo representa uma cela braille. Cont&amp;eacute;m ainda 48 pequenos c&amp;iacute;rculos para encaixar nos orif&amp;iacute;cios, os quais, quando colocados, ficar&amp;atilde;o em relevo e poder&amp;atilde;o formar as letras. Acompanha o alfabeto braille.&lt;/p&gt;\r\n'),
(88, 2, 'Colméia alfabética', '', '', '&lt;p&gt;\r\n	Estante retangular de madeira medindo 79 cm de altura, 67 de largura, 16 de profundidade. Composta de 24 compartimentos, dispostos em 4 fileiras de 6 compartimentos. Cada compartimento cont&amp;eacute;m alguns objetos cujo nome inicia com a letra inscrita na frente (menos o &amp;uacute;ltimo, que est&amp;aacute; vazio); Os objetos s&amp;atilde;o simples, pertencentes ao dia-a-dia da crian&amp;ccedil;a, feitos de material variado. Acompanha o alfabeto braille.&lt;/p&gt;\r\n'),
(90, 2, 'Dolly', '', '', '&lt;p&gt;\r\n	Livro de feltro, com seis folhas, na medida de 0,20 x 0,20 cm. Na capa encontra-se um cachorrinho de pel&amp;uacute;cia. Na parte superior de cada folha h&amp;aacute; uma frase correspondente &amp;agrave; hist&amp;oacute;ria de um cachorrinho, escrita em braille e em tinta. Todas as folhas cont&amp;ecirc;m brinquedos, miniaturas de objetos que ilustram a frase ali escrita.&lt;/p&gt;\r\n'),
(91, 2, 'Horabraille', '', '', '&lt;p&gt;\r\n	Rel&amp;oacute;gio feito de madeira revestida de f&amp;oacute;rmica, medindo 20 x 20 cm. Os ponteiros s&amp;atilde;o m&amp;oacute;veis, feitos em material emborrachado. Os n&amp;uacute;meros s&amp;atilde;o escritos em braille.&lt;/p&gt;\r\n'),
(92, 2, 'Que horas são?', '', '', '&lt;p&gt;\r\n	Rel&amp;oacute;gio feito de madeira revestida de f&amp;oacute;rmica, medindo 24 x 15 cm. Os ponteiros s&amp;atilde;o m&amp;oacute;veis, feitos em material emborrachado. No lugar dos n&amp;uacute;meros existem orif&amp;iacute;cios formando celas braille. Acompanham pinos para serem encaixados nas celas para formar os n&amp;uacute;meros.&lt;/p&gt;\r\n'),
(175, 2, 'Fantoche de rosto', '', '', '&lt;p&gt;\r\n	Luva confeccionada em tecido brilhante ou de cor viva com elementos que formam uma carinha na palma da m&amp;atilde;o.&lt;/p&gt;\r\n'),
(32, 2, 'Móbile bolinha', '', '', '&lt;p&gt;\r\n	Bastidor com di&amp;acirc;metro de 15 cm, pintado de amarelo. No bastidor existem 4 furos onde passam barbantes de mais de mais ou menos 40 cm. Na ponta de cada barbante est&amp;aacute; presa uma bola com guizo em cores variadas, os barbantes se unem na parte superior. Na ponta de uni&amp;atilde;o dos quatro barbantes est&amp;aacute; preso um 5&amp;ordm; barbante com bola na ponta.&lt;/p&gt;\r\n'),
(120, 2, 'Móbile de brinquedos', '', '', '&lt;p&gt;\r\n	M&amp;oacute;bile de brinquedos 2 ripas de madeira cruzadas com 26 cm de comprimento Nas 4 pontas das ripas existem orif&amp;iacute;cios por onde passam barbantes de 30 cm ou menos, que se encontram na parte superior para pendurar Nas 4 pontas dos barbantes est&amp;atilde;o pendurados 4 brinquedos que s&amp;atilde;o: bonequinha, chocalho, pratinho de pl&amp;aacute;stico e colherzinha.&lt;/p&gt;\r\n'),
(87, 2, 'Numerito', '', '', '&lt;p&gt;\r\n	Gaveteiro de pl&amp;aacute;stico medindo 54 cm de comprimento, 22 de largura e 12 de profundidade, composto de 10 gavetas dispostas em 2 colunas verticais. Dentro de cada gaveta existem objetos absolutamente iguais entre si, em quantidade correspondente &amp;agrave; inscri&amp;ccedil;&amp;atilde;o frontal. S&amp;atilde;o objetos de uso comum, do dia-a-dia da crian&amp;ccedil;a.&lt;/p&gt;\r\n'),
(186, 2, 'Domine Formas', '', '', ''),
(31, 2, 'Quebra Cabeça Toninho', '', '', '&lt;p&gt;\r\n	Brinquedo composto de uma placa de material emborrachado, leve e macio, medindo 27 x 22 cm. Em sua superf&amp;iacute;cie existe uma cavidade onde se encaixa a figura de um menino. A figura &amp;eacute; composta de partes separadas: pernas, bra&amp;ccedil;os, corpo e cabe&amp;ccedil;a, de cores diferentes.&lt;/p&gt;\r\n'),
(150, 2, 'Toque o Bebê', 'Toque o Bebê', 'Toque o Bebê', '&lt;p&gt;\r\n	Informa&amp;ccedil;&amp;otilde;es uteis para a melhor conviv&amp;ecirc;ncia com a crian&amp;ccedil;a deficiente visual. Dirigido aos m&amp;eacute;dicos e profissionais de sa&amp;uacute;de.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Adaptado por:&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;em&gt;&lt;strong&gt;Mara O. de Campos Siaulys&lt;br /&gt;\r\n	&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	18 p&amp;aacute;ginas.&lt;/p&gt;\r\n'),
(141, 2, 'GANMA Laramara', '', '', '&lt;p&gt;\r\n	&lt;i&gt;&lt;font size=&quot;4&quot;&gt;Brincando em fam&amp;iacute;lia&lt;/font&gt;&lt;/i&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Ajudar a fam&amp;iacute;lia nas brincadeiras adaptadas &amp;agrave; crian&amp;ccedil;as com defici&amp;ecirc;ncia neuromotora associada &amp;agrave; defici&amp;ecirc;ncia visual.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Autoras:&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;em&gt;&lt;strong&gt;Maria Teresa Rocha Tri&amp;ntilde;anes&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;em&gt;&lt;strong&gt;Rosana S. A. S. Furtado&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;em&gt;&lt;strong&gt;S&amp;ocirc;nia Mitico F. Gondo&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	8 P&amp;aacute;ginas.&lt;/p&gt;\r\n'),
(96, 2, 'O circo', '', '', ''),
(99, 2, 'Os brinquedos de Larinha', '', '', '&lt;p&gt;\r\n	Brinquedo composto de uma maleta de pl&amp;aacute;stico medindo 25 x 21 cm, contendo v&amp;aacute;rios brinquedos em miniaturas. Uma placa de papel&amp;atilde;o presa &amp;agrave; maleta traz uma pequena hist&amp;oacute;ria escrita em braille e em tinta. As miniaturas s&amp;atilde;o objetos que ilustram a hist&amp;oacute;ria.&lt;/p&gt;\r\n'),
(100, 2, 'What do I do with it?', '', '', '&lt;p&gt;\r\n	Caderno medindo 21 x 13 cm, contendo 30 folhas de pl&amp;aacute;stico separadas ao meio, formando assim dois compartimentos, no total de 60 compartimentos. No lado esquerdo de cada folha h&amp;aacute; um cart&amp;atilde;o com figuras simples e de f&amp;aacute;cil compreens&amp;atilde;o pela crian&amp;ccedil;a, coloridas, representando objetos. No final do caderno h&amp;aacute; uma bolsa, contendo 30 cart&amp;otilde;es com figuras que representam verbos ou a&amp;ccedil;&amp;otilde;es que podem ser praticadas com os objetos que fazem parte dos cart&amp;otilde;es encaixados na bolsa da esquerda. O nome do objeto e da a&amp;ccedil;&amp;atilde;o em ingl&amp;ecirc;s est&amp;aacute; escrito sobre cada uma das figuras. No final do livro existe um vocabul&amp;aacute;rio com a tradu&amp;ccedil;&amp;atilde;o das 60 palavras para o portugu&amp;ecirc;s.&lt;/p&gt;\r\n'),
(101, 2, 'Bug-ball', '', '', '&lt;p&gt;\r\n	Painel circular com 197 cm de di&amp;acirc;metro e 6 de espessura, forrado com tecido de nylon de cor preta, fechado com z&amp;iacute;per, remov&amp;iacute;vel. Numa das faces est&amp;atilde;o coladas figuras de cinco animais, uma no meio e as outras na posi&amp;ccedil;&amp;atilde;o dos quatro pontos cardeais. As figuras, nas cores vermelha, azul, amarela e verde, representam um cachorro, um gato, um elefante, um peixe e uma ave. O nome das quatro cores est&amp;aacute; escrito em ingl&amp;ecirc;s no lugar correspondente. O painel possui uma al&amp;ccedil;a para que possa ser pendurado. Acompanham duas bolas pretas, revestidas de tecido pluma que facilita a ader&amp;ecirc;ncia no velcro do painel.&lt;/p&gt;\r\n'),
(102, 2, 'Tack', '', '', '&lt;p&gt;\r\n	Brinquedo composto de nove placas recortadas em material leve e macio, em cores diferentes, nas seguintes formas: Quadrado, Tri&amp;acirc;ngulo, C&amp;iacute;rculo, Ret&amp;acirc;ngulo, Losango, Oval, Cora&amp;ccedil;&amp;atilde;o, Estrela, Hex&amp;aacute;gono Cada placa tem inscrito o nome em braille e em tinta. Em toda a volta das figuras encontram-se furos. Acompanham 9 cadar&amp;ccedil;os nas cores das placas.&lt;/p&gt;\r\n'),
(103, 2, 'Looking for opposites', '', '', '&lt;p&gt;\r\n	Livro com 26 x 16 cm, contendo 25 folhas cortadas ao meio, num total de 50 meias folhas em espiral. O livro cont&amp;eacute;m 50 figuras, 25 nas folhas da esquerda e 25 nas folhas da direita. No lado esquerdo s&amp;atilde;o figuras de objetos e fatos opostos &amp;agrave;queles que est&amp;atilde;o nas folhas da direita. Na parte superior de cada figura est&amp;aacute; escrito seu nome em ingl&amp;ecirc;s. S&amp;atilde;o figuras interessantes, coloridas, representando objetos ou fatos simples, conhecidos pelas crian&amp;ccedil;as. No final do livro existe um vocabul&amp;aacute;rio com a tradu&amp;ccedil;&amp;atilde;o das 50 palavras para o portugu&amp;ecirc;s.&lt;/p&gt;\r\n'),
(104, 2, 'Baixa Visão na Infância', 'Baixa Visão na Infância', 'Baixa Visão na Infância', '&lt;p&gt;\r\n	&lt;i&gt;&lt;font size=&quot;3&quot;&gt;Manual B&amp;aacute;sico para Oftalmologistas&lt;/font&gt;&lt;/i&gt;&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Subs&amp;iacute;dios ao atendimento da crian&amp;ccedil;a com baixa vis&amp;atilde;o, recursos para a avalia&amp;ccedil;&amp;atilde;o e aux&amp;iacute;lios especiais. &lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Autores:&lt;br /&gt;\r\n	&lt;i&gt; &lt;b&gt; Maria Aparecidade Onuki Haddad&lt;br /&gt;\r\n	Marco Wilson Sampaio&lt;br /&gt;\r\n	Newton Kara-jos&amp;eacute;&lt;br /&gt;\r\n	&lt;/b&gt; &lt;/i&gt; &lt;br /&gt;\r\n	44 P&amp;aacute;ginas.&lt;/p&gt;\r\n'),
(122, 2, 'Toque de letra', '', '', '&lt;p&gt;\r\n	Placa de pl&amp;aacute;stico medindo 10 x 14 cm em cuja superf&amp;iacute;cie encontram-se seis cavidades circulares com 4,5 cm de di&amp;acirc;metro. Seis bolas de pingue-pongue encaixadas nas cavidades. Na parte superior da placa, &amp;agrave; direita, um peda&amp;ccedil;o de velcro que serve para identificar a posi&amp;ccedil;&amp;atilde;o em que a placa dever&amp;aacute; estar na hora da brincadeira (&amp;agrave; direita, em cima).&lt;/p&gt;\r\n'),
(201, 2, 'Atividades de Vida Autônoma', 'Atividades de Vida Autônoma', 'Atividades de Vida Autônoma', '&lt;p&gt;\r\n	O objetivo principal deste manual &amp;eacute; mostrar &amp;agrave;s fam&amp;iacute;lias, professores e profissionais da &amp;aacute;rea da defici&amp;ecirc;ncia visual a possibilidade de usar brinquedos e brincadeiras para o aprendizado das atividades de vida aut&amp;ocirc;noma. O livro apresenta um question&amp;aacute;rio de avalia&amp;ccedil;&amp;atilde;o com perguntas referentes &amp;agrave;s atividades de vida aut&amp;ocirc;noma e importantes considera&amp;ccedil;&amp;otilde;es sobre a pesquisa realizada com as fam&amp;iacute;lias de usu&amp;aacute;rios da Laramara sobre o question&amp;aacute;rio.&amp;nbsp;&lt;/p&gt;\r\n'),
(202, 2, 'DVD BRINCAR PARA TODOS  C/ AUDIO DESCRIÇÃO', 'DVD BRINCAR PARA TODOS  C/ AUDIO DESCRIÇÃO', 'DVD BRINCAR PARA TODOS  C/ AUDIO DESCRIÇÃO', '&lt;p&gt;\r\n	Passo-a-passo para a confec&amp;ccedil;&amp;atilde;o de brinquedos especiais, produzidos e comercializados na Laramara. Sugest&amp;otilde;es de brincadeiras, compet&amp;ecirc;ncias e habilidades que eles favorecem. &lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Autora:&lt;br /&gt;\r\n	Mara O. de Campos Siaulys &lt;br /&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n'),
(108, 2, 'Orientação e Mobilidade', 'Orientação e Mobilidade', 'Orientação e Mobilidade', '&lt;p&gt;\r\n	Subs&amp;iacute;dios aos familiares, estudantes e profissionais de interven&amp;ccedil;&amp;atilde;o precoce, educa&amp;ccedil;&amp;atilde;o especial e reabilita&amp;ccedil;&amp;atilde;o de pesoas com defici&amp;ecirc;ncia visual. &lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Autores:&lt;br /&gt;\r\n	&lt;i&gt; &lt;b&gt; Jo&amp;atilde;o &amp;Aacute;lvaro de Moraes Felippe&lt;br /&gt;\r\n	Vera L&amp;uacute;cia Rhein Felippe&lt;br /&gt;\r\n	&lt;/b&gt; &lt;/i&gt; &lt;br /&gt;\r\n	179 P&amp;aacute;ginas.&lt;/p&gt;\r\n'),
(146, 2, 'Ler e Escrever em Braille', 'Ler e Escrever em Braille', 'Ler e Escrever em Braille', '&lt;p&gt;\r\n	Roteiro de atividades que favorecem o desenvolvimento da crian&amp;ccedil;a cega, do nascimento &amp;agrave; inclus&amp;atilde;o escolar.&lt;br /&gt;\r\n	Autora:&lt;br /&gt;\r\n	&lt;b&gt;&lt;i&gt;Mara O. de Campos Siaulys&lt;br /&gt;\r\n	&lt;/i&gt;&lt;/b&gt;16 p&amp;aacute;ginas&lt;/p&gt;\r\n'),
(142, 2, 'Manual Para Creches', 'Manual Para Creches', 'Manual Para Creches', '&lt;p&gt;\r\n	Esclarecimentos sobre as necessidades da crian&amp;ccedil;a com defici&amp;ecirc;ncia visual, aos profissionais de creches e pr&amp;eacute;-escolas. &lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Autoras:&lt;br /&gt;\r\n	&lt;i&gt; &lt;b&gt; Edna Eiko Nakahara&lt;br /&gt;\r\n	Margareth Pires da Motta&lt;br /&gt;\r\n	Maria Teresa R. Tri&amp;ntilde;anes&lt;br /&gt;\r\n	Rosana S. A. S. Furtado &lt;/b&gt; &lt;/i&gt; &lt;br /&gt;\r\n	&lt;br /&gt;\r\n	18 P&amp;aacute;ginas.&lt;/p&gt;\r\n'),
(145, 2, 'Papai, Mamãe - Ajudem-me Por Favor', 'Papai, Mamãe - Ajudem-me Por Favor', 'Papai, Mamãe - Ajudem-me Por Favor', '&lt;p&gt;\r\n	Sugest&amp;otilde;es que facilitam a intera&amp;ccedil;&amp;atilde;o com o beb&amp;ecirc; deficiente visual. &lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Autora:&lt;br /&gt;\r\n	&lt;i&gt; &lt;b&gt; Mara O. de campos Siaulys&lt;br /&gt;\r\n	&lt;/b&gt; &lt;/i&gt; &lt;br /&gt;\r\n	44 P&amp;aacute;ginas.&lt;/p&gt;\r\n'),
(115, 2, 'Passatempo', '', '', '&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify; &quot;&gt;\r\n	Painel feito de tecido de nylon azul, acolchoado, medindo 100cm de comprimento por 50cm de largura. O painel tem al&amp;ccedil;as nos lados mais estreitos,&amp;nbsp;transformando-se em uma sacola fechada por velcro nas laterais. Traz tamb&amp;eacute;m um gancho em forma de cabide por onde pode ser pendurado.&amp;nbsp;No painel h&amp;aacute; pequenos envelopes de pl&amp;aacute;stico onde s&amp;atilde;o encaixados cart&amp;otilde;es com os nomes dos meses do ano, dias da semana e dias do m&amp;ecirc;s. Em outros&amp;nbsp;envelopes, ao lado dos anteriores, s&amp;atilde;o encaixados cart&amp;otilde;es com nomes de datas festivas ou datas importantes para a crian&amp;ccedil;a. Outros envelopes permitem&amp;nbsp;que a crian&amp;ccedil;a coloque cart&amp;otilde;es referentes a atividades que ela desenvolve nos diferentes dias de semana. Um envelope maior cont&amp;eacute;m cart&amp;otilde;es&amp;nbsp;com v&amp;aacute;rias outras atividades extras que a crian&amp;ccedil;a pode alternar com as anteriores. Todos os cart&amp;otilde;es s&amp;atilde;o escritos em braille e em letra comum.&amp;nbsp;Na parte superior est&amp;atilde;o os t&amp;iacute;tulos: meses do ano, dias da semana e, na parte inferior, dias do m&amp;ecirc;s. Este material &amp;eacute; muito &amp;uacute;til para ajudar a crian&amp;ccedil;a&amp;nbsp;na organiza&amp;ccedil;&amp;atilde;o temporal e na organiza&amp;ccedil;&amp;atilde;o de suas atividades nos v&amp;aacute;rios dias da semana.&lt;/p&gt;\r\n'),
(116, 2, 'Caixinha de números', '', '', '&lt;p&gt;\r\n	Material composto de 10 caixas iguais, medindo cada uma 13,5 x 7 cm, feitas de pl&amp;aacute;stico transparente. Na tampa de cada caixa, encontra-se um n&amp;uacute;mero de 1 a 10 em braille e em tinta. No interior de cada caixa, existem objetos exatamente iguais entre si, em quantidade correspondente ao n&amp;uacute;mero inscrito na tampa. Esses objetos devem ser de uso comum, pertencentes ao dia-a-dia da crian&amp;ccedil;a, de f&amp;aacute;cil reconhecimento quando manuseados.&lt;/p&gt;\r\n'),
(140, 2, 'Caminhando Juntos', 'Caminhando Juntos', 'Caminhando Juntos', '&lt;p&gt;\r\n	&lt;i&gt;&lt;font size=&quot;3&quot;&gt;Manual de Habilidades de Orienta&amp;ccedil;&amp;atilde;o e Mobilidade&lt;/font&gt;&lt;/i&gt;&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Informa&amp;ccedil;&amp;otilde;es simples e pr&amp;aacute;ticas para a orienta&amp;ccedil;&amp;atilde;o da pessoa cega. &lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Autor:&lt;br /&gt;\r\n	&lt;i&gt; &lt;b&gt; Jo&amp;atilde;o &amp;Aacute;lvaro de Moraes Felippe&lt;br /&gt;\r\n	&lt;/b&gt; &lt;/i&gt; &lt;br /&gt;\r\n	56 P&amp;aacute;ginas.&lt;/p&gt;\r\n'),
(143, 2, 'Orientação aos Professores na Integração', 'Orientação aos Professores na Integração', 'Orientação aos Professores na Integração', '&lt;p&gt;\r\n	&lt;b&gt;Escolar da Crian&amp;ccedil;a com Baixa Vis&amp;atilde;o&lt;/b&gt;&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Adapta&amp;ccedil;&amp;otilde;es importantes para a inclus&amp;atilde;o das crian&amp;ccedil;as com baixa vis&amp;atilde;o na classe comum. &lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Autora:&lt;br /&gt;\r\n	&lt;i&gt; &lt;b&gt; Hsu Yun Min&lt;br /&gt;\r\n	&lt;/b&gt; &lt;/i&gt; &lt;br /&gt;\r\n	&lt;br /&gt;\r\n	4 P&amp;aacute;ginas.&lt;/p&gt;\r\n'),
(130, 2, 'DVD - Aprendizagem e Desenvolvimento da Criança com Deficiência', 'DVD - Aprendizagem e Desenvolvimento da Criança com Deficiência', 'DVD - Aprendizagem e Desenvolvimento da Criança com Deficiência', '&lt;p&gt;\r\n	As necessidades espec&amp;iacute;ficas da crian&amp;ccedil;a com defici&amp;ecirc;ncia visual do nascimento a adolesc&amp;ecirc;ncia.&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	&lt;b&gt;DVD&lt;/b&gt;&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Autora:&lt;br /&gt;\r\n	&lt;i&gt;&lt;b&gt; Mara O. de Campos Siaulys&lt;br /&gt;\r\n	&lt;/b&gt; &lt;/i&gt;&lt;/p&gt;\r\n'),
(131, 2, 'Kit Baixa Visão lll', 'Kit Baixa Visão lll', 'Kit Baixa Visão lll', '&lt;p&gt;\r\n	KIT III&lt;br /&gt;\r\n	2 MANUAIS&lt;br /&gt;\r\n	+ 1 CD ROM&lt;br /&gt;\r\n	+ 1 FITA DE V&amp;Iacute;DEO VHS - Avalia&amp;ccedil;&amp;atilde;o e Recursos para Baixa Vis&amp;atilde;o na Inf&amp;acirc;ncia&lt;/p&gt;\r\n'),
(132, 2, 'Auxílios Para Baixa Visão', 'Auxílios Para Baixa Visão', 'Auxílios Para Baixa Visão', '&lt;p&gt;\r\n	&lt;b&gt;Cole&amp;ccedil;&amp;atilde;o Baixa Vis&amp;atilde;o - Volume I&lt;/b&gt;&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Principais aux&amp;iacute;lios &amp;oacute;pticos, n&amp;atilde;o &amp;oacute;pticos e eletr&amp;ocirc;nicos, caracter&amp;iacute;sticas, vantagens, desvantagens e treinamento para seu uso.&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Autores:&lt;br /&gt;\r\n	&lt;b&gt;&lt;i&gt; Maria Aparecida Onuki Haddad&lt;br /&gt;\r\n	Marcos Wilson Sampaio&lt;br /&gt;\r\n	Newton Kara-jos&amp;eacute;&lt;br /&gt;\r\n	&lt;/i&gt;&lt;/b&gt; 98 P&amp;aacute;ginas&lt;/p&gt;\r\n'),
(133, 2, 'Kit Auxílios para Baixa Visão', 'Kit Auxílios para Baixa Visão', 'Kit Auxílios para Baixa Visão', '&lt;p&gt;\r\n	1 Manual Baixa Vis&amp;atilde;o: Conhecendo mais para ajudar melhor&lt;br /&gt;\r\n	2 Caderno de pautas ampliadas (favorecendo a escrita de letras ampliadas e melhorando o contraste)&lt;br /&gt;\r\n	1 l&amp;aacute;pis 4B&lt;br /&gt;\r\n	1 l&amp;aacute;pis 6B&lt;br /&gt;\r\n	1 caneta azul&lt;br /&gt;\r\n	1 caneta preta&lt;br /&gt;\r\n	1 guia de leitura acompanhada de texto exemplo&lt;br /&gt;\r\n	1 prancha inclinada para leitura porta-texto&lt;/p&gt;\r\n');
