(136, 2, 'Papai e Mamãe, Vamos Brincar', 'Papai e Mamãe, Vamos Brincar', 'Papai e Mamãe, Vamos Brincar', '&lt;p&gt;\r\n	A confec&amp;ccedil;&amp;atilde;o e uso de brinquedos como proposta de intera&amp;ccedil;&amp;atilde;o entre pais e filhos. &lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Autora:&lt;br /&gt;\r\n	&lt;i&gt; &lt;b&gt; Mara O. de Campos Siaulys&lt;br /&gt;\r\n	&lt;/b&gt; &lt;/i&gt; &lt;br /&gt;\r\n	70 P&amp;aacute;ginas.&lt;/p&gt;\r\n'),
(139, 2, 'Baixa Visão: Conhecendo Mais para Ajudar Melhor', 'Baixa Visão: Conhecendo Mais para Ajudar Melhor', 'Baixa Visão: Conhecendo Mais para Ajudar Melhor', '&lt;p&gt;\r\n	Esclarecimentos sobre baixa vis&amp;atilde;o e sugest&amp;otilde;es de atividades, modifica&amp;ccedil;&amp;otilde;es ambientais e materiais para melhorar a efici&amp;ecirc;ncia visual e o desenvolvimento da crian&amp;ccedil;a com defici&amp;ecirc;ncia visual. &lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Autores:&lt;br /&gt;\r\n	&lt;i&gt; &lt;b&gt; Hsu Yun Min&lt;br /&gt;\r\n	Marcos Wilson Sampaio&lt;br /&gt;\r\n	Maria Aparecida Onuki Haddad&lt;br /&gt;\r\n	&lt;/b&gt; &lt;/i&gt; &lt;br /&gt;\r\n	&lt;br /&gt;\r\n	36 P&amp;aacute;ginas.&lt;/p&gt;\r\n'),
(147, 2, 'Aprendendo junto com Papai e Mamãe', '', '', '&lt;p&gt;\r\n	Em linguagem simples e esclarecedora, este manual facilita a tarefa da fam&amp;iacute;lia na educa&amp;ccedil;&amp;atilde;o de seus filhos com baixa vis&amp;atilde;o.&lt;br /&gt;\r\n	Autora:&lt;br /&gt;\r\n	&lt;b&gt;&lt;i&gt;Mara O. de Campos Siaulys&lt;/i&gt;&lt;/b&gt;&lt;br /&gt;\r\n	28 p&amp;aacute;ginas&lt;/p&gt;\r\n'),
(148, 2, 'DVD - Ganma Laramara', 'DVD - Ganma Laramara', 'DVD - Ganma Laramara', '&lt;p&gt;\r\n	Ajudar a fam&amp;iacute;lia nas brincadeiras adaptadas &amp;agrave; crian&amp;ccedil;as com defici&amp;ecirc;ncia neuromotora associada &amp;agrave; defici&amp;ecirc;ncia visual.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Autoras:&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;em&gt;&lt;strong&gt;Maria Teresa Rocha Tri&amp;ntilde;anes&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;em&gt;&lt;strong&gt;Rosana S. A. S. Furtado&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;em&gt;&lt;strong&gt;S&amp;ocirc;nia Mitico F. Gondo&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n'),
(149, 2, 'Jogo da memória', '', '', '&lt;p&gt;\r\n	Tabuleiro de EVA amarelo medindo 36 x 24 cm com tiras de 0,5 cm de espessura, formando 24 quadrados de 5,5 cm. Cont&amp;eacute;m 24 pe&amp;ccedil;as quadradas de EVA vermelho, medindo 5 cm cada, formando 12 pares com texturas (algod&amp;atilde;o, corti&amp;ccedil;a, tela de nylon, tela pl&amp;aacute;stica, feltro, lixa, carpete, espuma, pel&amp;uacute;cia, papel canelado, tapete emborrachado com listras em revelo, tapete emborrachado com bolinhas em relevo), que se encaixam nos quadrados do tabuleiro.&lt;/p&gt;\r\n'),
(151, 2, 'Brincar Para Todos', '', '', '&lt;p&gt;\r\n	Sugest&amp;otilde;es para a confec&amp;ccedil;&amp;atilde;o e brincadeiras com 109 brinquedos especiais. &lt;br /&gt;\r\n	Compet&amp;ecirc;ncias e habilidades que eles favorecem. &lt;br /&gt;\r\n	&lt;br /&gt;\r\n	&lt;em&gt;&lt;strong&gt;Autora:&lt;br /&gt;\r\n	Mara O. de Campos Siaulys &lt;br /&gt;\r\n	&lt;/strong&gt;&lt;/em&gt; &lt;br /&gt;\r\n	154 p&amp;aacute;ginas&lt;/p&gt;\r\n'),
(189, 2, 'DVD Caminhando Juntos', '', '', '&lt;p&gt;\r\n	&lt;i&gt;&lt;font size=&quot;3&quot;&gt;Manual de Habilidades de Orienta&amp;ccedil;&amp;atilde;o e Mobilidade&lt;/font&gt;&lt;/i&gt;&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Informa&amp;ccedil;&amp;otilde;es simples e pr&amp;aacute;ticas para a orienta&amp;ccedil;&amp;atilde;o da pessoa cega.&amp;nbsp;&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Autor:&lt;br /&gt;\r\n	&lt;i&gt;&lt;b&gt;Jo&amp;atilde;o &amp;Aacute;lvaro de Moraes Felippe&lt;/b&gt;&lt;/i&gt;&lt;br /&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	DVD com audiodescri&amp;ccedil;&amp;atilde;o&lt;/p&gt;\r\n'),
(154, 2, 'CD Brincar Para Todos', 'CD Brincar Para Todos', 'CD Brincar Para Todos', '&lt;p&gt;\r\n	Composto por 5 CD&amp;acute;s Vers&amp;atilde;o &amp;Aacute;udio&lt;/p&gt;\r\n'),
(198, 2, 'DVD - Baixa Visão na Infância', 'Baixa Visão na Infância', 'Baixa Visão na Infância', '&lt;p&gt;\r\n	&lt;i&gt;&lt;font size=&quot;3&quot;&gt;Manual B&amp;aacute;sico para Oftalmologistas&lt;/font&gt;&lt;/i&gt;&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Subs&amp;iacute;dios ao atendimento da crian&amp;ccedil;a com baixa vis&amp;atilde;o, recursos para a avalia&amp;ccedil;&amp;atilde;o e aux&amp;iacute;lios especiais. &lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Autores:&lt;br /&gt;\r\n	&lt;i&gt; &lt;b&gt; Maria Aparecidade Onuki Haddad&lt;br /&gt;\r\n	Marco Wilson Sampaio&lt;br /&gt;\r\n	Newton Kara-jos&amp;eacute;&lt;/b&gt;&lt;/i&gt;&lt;/p&gt;\r\n'),
(158, 2, 'A Inclusão do Aluno com Baixa Visão no Ensino Regular c/ DVD', '', '', '&lt;p&gt;\r\n	&lt;i&gt;&lt;b&gt;Orienta&amp;ccedil;&amp;otilde;es aos Professores da Escola Regular &lt;/b&gt;&lt;/i&gt;&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Inclus&amp;atilde;o social, um desafio: mudar a pr&amp;aacute;tica, a atitude e a cultura. Estar na escola n&amp;atilde;o &amp;eacute; suficiente!&lt;/p&gt;\r\n&lt;p&gt;\r\n	Inclui DVD com audiodescri&amp;ccedil;&amp;atilde;o.&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Autora do projeto: &lt;br /&gt;\r\n	&lt;i&gt; &lt;b&gt; Mara Olimpia de Campos Siaulys &lt;/b&gt;&lt;/i&gt;&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	174 p&amp;aacute;ginas&lt;/p&gt;\r\n'),
(160, 2, 'DVD Brincar Para Todos', 'DVD Brincar Para Todos', 'DVD Brincar Para Todos', '&lt;p&gt;\r\n	Passo-a-passo para a confec&amp;ccedil;&amp;atilde;o de brinquedos especiais, produzidos e comercializados na Laramara. Sugest&amp;otilde;es de brincadeiras, compet&amp;ecirc;ncias e habilidades que eles favorecem. &lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Autora:&lt;br /&gt;\r\n	Mara O. de Campos Siaulys &lt;br /&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n'),
(161, 2, 'Avaliação Educacional de Alunos com Baixa Visão e Múltipla Deficiencias', 'Avaliação Educacional de Alunos com Baixa Visão e Múltipla Deficiencias', 'Avaliação Educacional de Alunos com Baixa Visão e Múltipla Deficiencias', '&lt;p&gt;\r\n	Este livro apresenta subs&amp;iacute;dios te&amp;oacute;ricos para a compreens&amp;atilde;o das necessidades espec&amp;iacute;ficas de crian&amp;ccedil;as com m&amp;uacute;ltipla defici&amp;ecirc;ncia; descreve os itens e procedimentos da avalia&amp;ccedil;&amp;atilde;o funcional da vis&amp;atilde;o... &lt;br /&gt;\r\n	&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Autora: &lt;br /&gt;\r\n	&lt;i&gt; &lt;b&gt; Marilda Moraes Garcia Bruno &lt;/b&gt;&lt;/i&gt;&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	196 p&amp;aacute;ginas&lt;/p&gt;\r\n'),
(138, 2, 'A  Esperança do Sucesso em Matemática está na Semente', '', '', '&lt;p&gt;\r\n	Como usar o Cuisinare gigante e adaptado na aprendizagem da matem&amp;aacute;tica. &lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Autora:&lt;br /&gt;\r\n	&lt;i&gt; &lt;b&gt; Wilma Pires de Miranda&lt;br /&gt;\r\n	&lt;/b&gt; &lt;/i&gt; &lt;br /&gt;\r\n	&lt;br /&gt;\r\n	6 P&amp;aacute;ginas.&lt;/p&gt;\r\n'),
(129, 2, 'Manual Braille', 'Manual Braille', 'Manual Braille', '&lt;p&gt;\r\n	A m&amp;aacute;quina de escrever Braille &amp;eacute; o mais eficiente instrumento de educa&amp;ccedil;&amp;atilde;o para a pessoa cega. Este manual ilustrado mostra de maneira muito simples, como utilizar a m&amp;aacute;quina para escrever neste sistema. &lt;br /&gt;\r\n	Autoras:&lt;br /&gt;\r\n	&lt;i&gt;&lt;b&gt; Cec&amp;iacute;lia Oka e &lt;br /&gt;\r\n	Wilma Pires de Miranda&lt;br /&gt;\r\n	&lt;/b&gt; &lt;/i&gt; 48 p&amp;aacute;ginas&lt;/p&gt;\r\n'),
(95, 2, 'A carta', '', '', '&lt;p&gt;\r\n	Brinquedo composto de uma maleta de pl&amp;aacute;stico com 22 x 20 cm contendo objetos referentes &amp;agrave; elabora&amp;ccedil;&amp;atilde;o e ao envio de uma carta. Um cart&amp;atilde;o com uma pequena hist&amp;oacute;ria escrita em braille e em escrita comum acompanha o kit.&lt;/p&gt;\r\n'),
(167, 2, 'Revista Contato Vol. 01', '', '', '&lt;p&gt;\r\n	&lt;b&gt;&lt;i&gt;Contato Volume 1 - Conversas sobre Defici&amp;ecirc;ncia Visual &lt;/i&gt;&lt;/b&gt;&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Publica&amp;ccedil;&amp;otilde;es sobre defici&amp;ecirc;ncia visual, apresentando trabalhos, experi&amp;ecirc;ncias e estudos feitos no Brasil e outros pa&amp;iacute;ses.&lt;/p&gt;\r\n'),
(168, 2, 'Revista Contato Vol. 02', '', '', '&lt;p&gt;\r\n	&lt;b&gt;&lt;i&gt;Contato Volume 2 - Conversas sobre Defici&amp;ecirc;ncia Visual&amp;nbsp;&lt;/i&gt;&lt;/b&gt;&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Publica&amp;ccedil;&amp;otilde;es sobre defici&amp;ecirc;ncia visual, apresentando trabalhos, experi&amp;ecirc;ncias e estudos feitos no Brasil e outros pa&amp;iacute;ses.&lt;/p&gt;\r\n'),
(169, 2, 'Revista Contato Vol. 07', '', '', '&lt;p&gt;\r\n	&lt;b&gt;&lt;i&gt;Contato &amp;nbsp;Volume 7 - Conversas sobre Defici&amp;ecirc;ncia Visual&lt;/i&gt;&lt;/b&gt;&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	157 p&amp;aacute;ginas&lt;/p&gt;\r\n'),
