(159, 2, 'CD Revista Contato Vol. 8', 'CD Revista Contato 8', 'CD Revista Contato 8', '&lt;p&gt;\r\n	Conversas sobre Defici&amp;ecirc;ncia Visual &lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Louis Braille 200 anos do nascimento &lt;br /&gt;\r\n	CD Rom (Vers&amp;atilde;o &amp;Aacute;udio)&lt;/p&gt;\r\n'),
(187, 2, 'Deficiência Visual Associada Á Deficiência Múltipla: Encarando Desafios e Construindo Possibilidades', '', '', '&lt;p&gt;\r\n	A educa&amp;ccedil;&amp;atilde;o das crian&amp;ccedil;as jovens com paralisia cerebral &amp;eacute; um desafio para todos os educadores, no atendimento &amp;agrave;s necessidades especiais.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Manual com 304 p&amp;aacute;ginas.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Organizadoras&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;&lt;em&gt;Mara O. de Campos Siaulys&lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;&lt;em&gt;Eliana Ormelezi&lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;&lt;em&gt;Maria Em&amp;iacute;lia Briant&lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;\r\n'),
