(172, 2, 'Revista Contato Vol. 04', '', '', '&lt;p&gt;\r\n	&lt;b&gt;&lt;i&gt;Contato Volume 4 - Conversas sobre Defici&amp;ecirc;ncia Visual&amp;nbsp;&lt;/i&gt;&lt;/b&gt;&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Publica&amp;ccedil;&amp;otilde;es sobre defici&amp;ecirc;ncia visual, apresentando trabalhos, experi&amp;ecirc;ncias e estudos feitos no Brasil e outros pa&amp;iacute;ses.&lt;/p&gt;\r\n'),
(173, 2, 'Revista Contato Vol. 03', '', '', '&lt;p&gt;\r\n	&lt;b&gt;&lt;i&gt;Contato Volume 3 - Conversas sobre Defici&amp;ecirc;ncia Visual&amp;nbsp;&lt;/i&gt;&lt;/b&gt;&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Publica&amp;ccedil;&amp;otilde;es sobre defici&amp;ecirc;ncia visual, apresentando trabalhos, experi&amp;ecirc;ncias e estudos feitos no Brasil e outros pa&amp;iacute;ses.&lt;/p&gt;\r\n'),
(174, 2, 'Revista Contato Vol. 06 com CD', '', '', '&lt;p&gt;\r\n	&lt;b&gt;&lt;i&gt;Contato - Conversas sobre Defici&amp;ecirc;ncia Visual &lt;/i&gt;&lt;/b&gt;&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Louis Braille 200 anos do nascimento - Especial Manual Ilustrado para o uso do Braille - Revista da Laramara Associa&amp;ccedil;&amp;atilde;o Brasileira de Assist&amp;ecirc;ncia ao Deficiente Visual - N&amp;uacute;mero 8 - Novembro 2009 - &lt;br /&gt;\r\n	&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	130 p&amp;aacute;ginas&lt;/p&gt;\r\n'),
(176, 2, 'Pendurando Formas', '', '', '&lt;p&gt;\r\n	Placa retangular de EVA, colorida, macia, medindo 36cm X 56cm. Na superf&amp;iacute;cie da placa existem ganchos em n&amp;uacute;mero de 12, formando quaro carreiras, tendo cada uma tr&amp;ecirc;s ganchos. Acompanhan placas coloridas das seguintes cores e formas:&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		Tr&amp;ecirc;s quadrados sendo:&amp;nbsp;o maior com 8cm de lado, o m&amp;eacute;dio com 6cm de lado e o menor com 4cm de lado.&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Tr&amp;ecirc;s c&amp;iacute;rculos, sendo: o maio com di&amp;acirc;metro de 8cm, o m&amp;eacute;dio com di&amp;acirc;metro de 6cm e o menor com di&amp;acirc;metro de 4cm.&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Tr&amp;ecirc;s ret&amp;acirc;ngulos, sendo: o maior 9cm x 4,5cm, o m&amp;eacute;dio 7 cm x 3 cm e o menor 4cm x 2cm.&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Tr&amp;ecirc;s tri&amp;acirc;ngulos de lados iguais, sendo: &amp;nbsp;o maior com 9cm de lado, o m&amp;eacute;dio com 6cm de lado e o menor com 4cm de lado.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n'),
(177, 2, 'Rebola Bola', '', '', '&lt;p&gt;\r\n	Caixa de madeira retangular amarela, medindo 80cm de comprimento, 40cm de largura e 12,5cm de altura, dividida em 18 compartimentos iguais, dispostos em tr&amp;ecirc;s fileiras horizontais, de seis compartimentos cada. Acompanham 18 pares de bolas, de diferentes cores, materiais, peso, textura, temperatura, consist&amp;ecirc;ncia, sendo algumas sonoras. As 36 bolinhas est&amp;atilde;o colocadas em um recipiente de pl&amp;aacute;stico redondo.&lt;/p&gt;\r\n'),
(5, 2, 'Guizo pé-mão Kit', '', '', '&lt;p&gt;\r\n	Duas pulseiras de tecido vermelho com guizos e duas tornozeleiras de tecido azul tamb&amp;eacute;m com guizos.&lt;/p&gt;\r\n'),
(2, 2, 'Ao pé do ouvido', '', '', '&lt;p&gt;\r\n	Painel feito de tecido macio, acolchoado, colorido, medindo 100 x 80 cm. No painel h&amp;aacute; dez pequenas argolas onde est&amp;atilde;o presos el&amp;aacute;sticos de 15 cm. Na ponta dos el&amp;aacute;sticos est&amp;atilde;o amarrados brinquedos sonoros: pandeiro, corneta, chocalho, apito, gaita, sanfona, etc.&lt;/p&gt;\r\n'),
