(183, 2, 'Cobrinha', '', '', ''),
(185, 2, 'Pingue Pongue', '', '', ''),
(97, 2, 'Ajudando a mamãe', '', '', '&lt;p&gt;\r\n	Livro feito em tecido com 22 X 20 cm tendo como tema as atividades e afazeres dom&amp;eacute;sticos. Possui 8 folhas, presas com um la&amp;ccedil;o de fita. Cada folha cont&amp;eacute;m uma ou duas frases, em braille e em tinta, e elementos em relevo que ilustram as frases; s&amp;atilde;o objetos do dia-a-dia, familiares &amp;agrave; crian&amp;ccedil;a, roupas e utens&amp;iacute;lios usados na alimenta&amp;ccedil;&amp;atilde;o.&lt;/p&gt;\r\n'),
(20, 2, 'Bicharada', '', '', '&lt;p&gt;\r\n	Painel feito de papel&amp;atilde;o plastificado, medindo 55 x 25 cm. Em uma das faces do painel existem duas fileiras horizontais, com silhuetas negras animais: porco, pato, macaco, galo, coelho, cavalo, rato, gato, cachorro e vaca. Na face oposta, est&amp;aacute; o contorno das mesmas figuras. Envelope com dez ret&amp;acirc;ngulos transparentes de 10 x 10 cm com o contorno das figuras.&lt;/p&gt;\r\n'),
(127, 2, 'Batalha naval', '', '', '&lt;p&gt;\r\n	Batalha naval Dois tabuleiros de EVA nas cores vermelha e amarela, medindo 32 x 32 cm com recorte em &amp;acirc;ngulo do lado direito superior, formados cada um por 5 colunas com 8 quadrados (o primeiro vazio e do segundo ao oitavo com as letras de A &amp;agrave; G, respectivamente, ampliadas e em braille) de 4,2 cm cada, e outras 4 colunas em formato retangular medindo 6,2 cm (do primeiro ao quarto numerados de 1 a 4, respectivamente), divididos por tiras de EVA de 0,5 cm de espessura. Cont&amp;ecirc;m 8 barcos em miniatura.&lt;/p&gt;\r\n'),
(81, 2, 'Brailito', '', '', '&lt;p&gt;\r\n	Brinquedo confeccionado em material leve e macio, composto de 47 ret&amp;acirc;ngulos medindo 3 x 2 cm cada um. Cada ret&amp;acirc;ngulo representa uma cela braille e nele est&amp;atilde;o inseridos pinos met&amp;aacute;licos formando as letras do alfabeto, em braille, as vogais acentuadas e duplicatas das vogais e consoantes de uso mais freq&amp;uuml;ente. No lado de dentro da tampa existe um espa&amp;ccedil;o onde poder&amp;atilde;o ser acomodados os ret&amp;acirc;ngulos com as letras em braille para formar palavras. Acompanha o alfabeto braille.&lt;/p&gt;\r\n'),
(80, 2, 'Brailex', '', '', '&lt;p&gt;\r\n	Prancheta de madeira perfurada, medindo 40x18 cm, com furos agrupados de 6 em 6, reproduzindo as celas braille. Acompanha uma caixa com 72 pinos met&amp;aacute;licos sem ponta. Acompanha o alfabeto braille.&lt;/p&gt;\r\n'),
(17, 2, 'Casal legal - Léo e Lu', '', '', '&lt;p&gt;\r\n	Bonequinhos revestidos de pluma branca, leves e agrad&amp;aacute;veis ao tato, representando uma menina e um menino. A boneca est&amp;aacute; com vestido amarelo, fechado com velcro nas costas e avental de tecido xadrez preto e branco. Nos p&amp;eacute;s, dois la&amp;ccedil;os de fita amarela. O boneco est&amp;aacute; vestido com macac&amp;atilde;o amarelo tendo na frente um bolso xadrez preto e branco. Sob o macac&amp;atilde;o, uma camisa do mesmo tecido xadrez preto e branco, abotoada nas costas com velcro.&lt;/p&gt;\r\n'),
(152, 2, 'Em cima da hora', '', '', '&lt;p&gt;\r\n	De maneira simples e r&amp;aacute;pida este brinquedo facilita &amp;agrave;s pessoas cegas a localiza&amp;ccedil;&amp;atilde;o dos alimentos em seu prato.&lt;br /&gt;\r\n	Basta que ele seja informado sobre o nome do alimento colocado na dire&amp;ccedil;&amp;atilde;o de determinada hora. &lt;br /&gt;\r\n	&lt;br /&gt;\r\n	12hs arroz&lt;br /&gt;\r\n	3hs feij&amp;atilde;o&lt;br /&gt;\r\n	6 hs ovo frito&lt;br /&gt;\r\n	9hs salsicha&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Para crian&amp;ccedil;as pequenas o brinquedo ajuda no reconhecimento t&amp;aacute;til dos alimentos crus, seus nomes e como escrev&amp;ecirc;-los. Desenvolve o tato e o vocabul&amp;aacute;rio.&lt;/p&gt;\r\n'),
(121, 2, 'Formcolor', '', '', '&lt;p&gt;\r\n	Prancheta preta, retangular, com textura lisa, de material leve e macio, medindo 27 x 22 cm, tendo em uma das faces vinte orif&amp;iacute;cios nas quatro formas geom&amp;eacute;tricas principais: cinco quadrados, cinco c&amp;iacute;rculos, cinco ret&amp;acirc;ngulos e cinco tri&amp;acirc;ngulos. Vinte placas de textura granulosa, com as mesmas formas geom&amp;eacute;tricas, sendo cada forma de uma cor: amarelo, azul, verde e vermelho.&lt;/p&gt;\r\n'),
(39, 2, 'Formas e números', '', '', '&lt;p&gt;\r\n	Material composto de uma prancheta retangular de material leve e macio, de cor branca, medindo 47,5 x 28 cm. Sobre a prancheta encontram-se 9 pinos de 12 cm dispostos em 3 carreiras horizontais. Pr&amp;oacute;ximo de cada pino temos um n&amp;uacute;mero de 1 a 9 em braille e em tinta; Acompanham 45 pe&amp;ccedil;as, com um furo central, de nove formas diferentes: oval, ret&amp;acirc;ngulo, hex&amp;aacute;gono, quadrado, c&amp;iacute;rculo, estrela, cora&amp;ccedil;&amp;atilde;o, losango e tri&amp;acirc;ngulo.&lt;/p&gt;\r\n'),
(35, 2, 'Formatando', '', '', '&lt;p&gt;\r\n	Brinquedo composto de uma prancheta retangular, medindo 46,5 x 25 cm, de cor branca, feita de material leve e macio, onde se encontram 4 cavidades em forma das 4 figuras geom&amp;eacute;tricas: quadrado, c&amp;iacute;rculo, tri&amp;acirc;ngulo e ret&amp;acirc;ngulo. Acompanham 4 placas com as mesmas formas geom&amp;eacute;tricas, que se encaixam nas cavidades, e ficam um pouco mais altas do que a superf&amp;iacute;cie da prancheta.&lt;/p&gt;\r\n'),
(188, 2, 'CD Caminhando Juntos', '', '', '&lt;p&gt;\r\n	&lt;i&gt;&lt;font size=&quot;3&quot;&gt;Manual de Habilidades de Orienta&amp;ccedil;&amp;atilde;o e Mobilidade&lt;/font&gt;&lt;/i&gt;&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Informa&amp;ccedil;&amp;otilde;es simples e pr&amp;aacute;ticas para a orienta&amp;ccedil;&amp;atilde;o da pessoa cega.&amp;nbsp;&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Autor:&lt;br /&gt;\r\n	&lt;i&gt;&lt;b&gt;Jo&amp;atilde;o &amp;Aacute;lvaro de Moraes Felippe&lt;/b&gt;&lt;/i&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	CD com audiodescri&amp;ccedil;&amp;atilde;o&lt;/p&gt;\r\n'),
(75, 2, 'Ao pé da letra', '', '', '&lt;p&gt;\r\n	Painel retangular, feito de material emborrachado leve e macio, de cor azul, medindo 100 x 60 cm. Cada bolso &amp;eacute; identificado por uma letra em braille e em tinta e cont&amp;eacute;m pequenos objetos cujo nome inicia com essa letra. Os objetos s&amp;atilde;o simples, pertencentes ao dia-a-dia da crian&amp;ccedil;a, feitos de material variado. Acompanha o alfabeto braille.&lt;/p&gt;\r\n'),
(191, 2, 'Body-ball (Quadro Menino)', '', '', '&lt;p&gt;\r\n	Brinquedo composto por um painel de madeira, de cor branca, medindo 85 cm de altura e 62 de largura. Sobre o painel est&amp;aacute; colado a figura de uma menina ou um menino com a mesma altura do painel. A figura de tecido pluma, t&amp;ecirc;m roupas de cores fortes, sapatos e meias, tudo feito com o mesmo tecido. Os bonecos possuem cabelos sendo o da menina destacado do painel e amarrado com fita. Acompanha uma bolinha de cor preta com elementos de velcro que facilitam a ader&amp;ecirc;ncia ao tecido de pluma dos bonecos.&lt;/p&gt;\r\n'),
(38, 2, 'Gira-gira', '', '', '&lt;p&gt;\r\n	Brinquedo composto de duas placas circulares, sobrepostas, feitas de material leve e macio, medindo 49,5 cm de di&amp;acirc;metro, de cor amarela, uma girando sobre a outra. Acompanha um recipiente redondo com tampa, cheio de pe&amp;ccedil;as recortadas nas mesmas formas das cavidades, com texturas, tamanhos e cores variadas, sendo algumas vazadas.&lt;/p&gt;\r\n'),
(60, 2, 'Como gente grande', '', '', '&lt;p&gt;\r\n	Brinquedo composto de um tapete acolchoado de cor amarela, arrematado em volta em cor vermelha, medindo 50 x 100 cm, com duas al&amp;ccedil;as que o transformam em uma sacola. No interior existem dezoito bolsos de pl&amp;aacute;stico, nove em cada metade da sacola. Uma sacola suplementar com as mesmas caracter&amp;iacute;sticas, medindo 45 x 50 cm cont&amp;eacute;m dezoito objetos, sendo nove de cozinha e nove de banheiro, em sua forma e tamanho reais: peneira, funil, palha de a&amp;ccedil;o, esponja, espremedor de laranja, garfo, pasta de dente, escova de cabelo, pente, bucha para banho, talco, desodorante.&lt;/p&gt;\r\n'),
(65, 2, 'Porta Trecos', '', '', '&lt;p&gt;\r\n	Pote redondo medindo 53 cm de altura e 14 cm de di&amp;acirc;metro. Forrado em tecido de cor forte tendo na parte externa aplica&amp;ccedil;&amp;otilde;es de atraentes figuras feitas de feltro, bem coloridas, representando cenas, como por exemplo o circo, o mar, etc.&lt;/p&gt;\r\n'),
(50, 2, 'Sacoleca', '', '', '&lt;p&gt;\r\n	Brinquedo composto de prancheta feita de material leve e macio, medindo 40 x 40 cm na cor preta. Acompanham quatro potes de pl&amp;aacute;stico tampados nas cores: amarelo, vermelho, azul e verde. Recipiente redondo de pl&amp;aacute;stico, contendo objetos de 4 tipos diferentes: conchas, moedas, pedras e bolas de gude.&lt;/p&gt;\r\n'),
(66, 2, 'Bengala infantil', '', '', '&lt;p&gt;\r\n	O pre&amp;ccedil;o da bengala dobr&amp;aacute;vel com ponteira fixa de 0,70cm at&amp;eacute; 0,95cm ? R$ 38,00 no estado de S&amp;atilde;o Paulo * Bengala dobr&amp;aacute;vel * Alum&amp;iacute;nio leve * Cabo de borracha e anat&amp;ocirc;mico (macio e de f&amp;aacute;cil manuseio) * Pintura eletrost&amp;aacute;tica (reflete a luz) * Ponteira fixa ou roller de nylon 6.0 / di&amp;acirc;metro 20mm (maior durabilidade) * El&amp;aacute;stico revestido c/ nylon ? 04 voltas (maior resist&amp;ecirc;ncia) * Tamanhos diversos&lt;/p&gt;\r\n'),
(89, 2, 'Brincando com as horas', '', '', '&lt;p&gt;\r\n	Livro de material emborrachado, medindo 30 x 22 cm com seis folhas. A &amp;uacute;ltima folha cont&amp;eacute;m uma dobra e, ao ser aberta, fica em posi&amp;ccedil;&amp;atilde;o superior &amp;agrave;s outras. Nela encontra-se um rel&amp;oacute;gio de forma redonda, com n&amp;uacute;meros em braille e em tinta. Cada folha cont&amp;eacute;m frases em braille e em tinta com descri&amp;ccedil;&amp;otilde;es de fatos que acontecem nas diferentes horas e per&amp;iacute;odos do dia, com atividades que fazem parte do cotidiano das crian&amp;ccedil;as. As frases s&amp;atilde;o ilustradas com elementos concretos, objetos familiares, pertencentes ao dia-a-dia da crian&amp;ccedil;a.&lt;/p&gt;\r\n'),
(69, 2, 'Gaveteiro alfabético', '', '', '&lt;p&gt;\r\n	Estante retangular de pl&amp;aacute;stico medindo 91 cm de largura, 34 de altura e 12 de profundidade. Composta de 24 gavetas dispostas em 6 fileiras horizontais de 4 gavetas. Os objetos s&amp;atilde;o simples, pertencentes ao dia-a-dia da crian&amp;ccedil;a, de material e uso variados. Acompanha o alfabeto braille.&lt;/p&gt;\r\n'),
(193, 2, 'Baixa Visão na Infância - Guia Prático de Atenção Oftalmológica', '', '', '&lt;p style=&quot;text-align: justify; &quot;&gt;\r\n	O guia apresenta informa&amp;ccedil;&amp;otilde;es essenciais para o desenvolvimento do trabalho junto &amp;agrave; popula&amp;ccedil;&amp;atilde;o de crian&amp;ccedil;as e adolescentes com baixa vis&amp;atilde;o. Destaca-se o trabalho desenvolvido pela Laramara, que po meio de suas in&amp;uacute;meras a&amp;ccedil;&amp;otilde;es procura modificar o panorama da defici&amp;ecirc;ncia visual no nosso pa&amp;iacute;s.&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify; &quot;&gt;\r\n	Os autores abordam aspectos relativos &amp;agrave; pr&amp;aacute;tica oftalmol&amp;oacute;gica para a promo&amp;ccedil;&amp;atilde;o da sa&amp;uacute;de ocular e da qualidade de vida das pessoas com baixa vis&amp;atilde;o, assim como, a import&amp;acirc;ncia da atua&amp;ccedil;&amp;atilde;o interdisciplinar do m&amp;eacute;dico oftalmologista como agente catalisador do processo de habilita&amp;ccedil;&amp;atilde;o ou reabilita&amp;ccedil;&amp;atilde;o visual.&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify; &quot;&gt;\r\n	Autores:&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify; &quot;&gt;\r\n	&lt;em&gt;&lt;strong&gt;Maria Aperecida Onuki Haddad&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify; &quot;&gt;\r\n	&lt;em&gt;&lt;strong&gt;Mara O. de Campos Siaulys&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify; &quot;&gt;\r\n	&lt;em&gt;&lt;strong&gt;Marcos Wilson Sampaio&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify; &quot;&gt;\r\n	Inclui um DVD.&lt;/p&gt;\r\n'),
(194, 2, 'CD - Deficiência Visual Associada Á Deficiência Múltipla: Encarando Desafios e Construindo Possibilidades', '', '', '&lt;p&gt;\r\n	A educa&amp;ccedil;&amp;atilde;o das crian&amp;ccedil;as jovens com paralisia cerebral &amp;eacute; um desafio para todos os educadores, no atendimento &amp;agrave;s necessidades especiais.&lt;/p&gt;\r\n&lt;p&gt;\r\n	CD com audiodescri&amp;ccedil;&amp;atilde;o.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Organizadoras&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;&lt;em&gt;Mara O. de Campos Siaulys&lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;&lt;em&gt;Eliana Ormelezi&lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;&lt;em&gt;Maria Em&amp;iacute;lia Briant&lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;\r\n'),
(195, 2, 'Mercenário ou Missionário?', '', '', '&lt;p&gt;\r\n	&lt;span style=&quot;font-family:tahoma,geneva,sans-serif;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-size: 14px; line-height: 21px; &quot;&gt;&amp;Eacute; um livro corajoso que descreve as li&amp;ccedil;&amp;otilde;es aprendidas como empreendedor social e empres&amp;aacute;rio exitoso. Saiba como um vendedor de peixes na feira livre conseguiu construir uma das maiores ind&amp;uacute;strias farmac&amp;ecirc;uticas do Brasil e da Am&amp;eacute;rica do Sul, sem deixar de transferir para fam&amp;aacute;lias carentes toda a experi&amp;ecirc;ncia acumulada na educa&amp;ccedil;&amp;atilde;o de sua filha cega.&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;color: rgb(0, 0, 0); font-family: Verdana, Arial, sans-serif; font-size: 14px; line-height: 21px; &quot; /&gt;\r\n	&lt;br style=&quot;color: rgb(0, 0, 0); font-family: Verdana, Arial, sans-serif; font-size: 14px; line-height: 21px; &quot; /&gt;\r\n	&lt;b style=&quot;color: rgb(0, 0, 0); font-family: Verdana, Arial, sans-serif; font-size: 14px; line-height: 21px; &quot;&gt;&lt;i&gt;Autor: Victor Siaulys, fundador da institui&amp;ccedil;&amp;atilde;o Laramara junto com sua esposa Mara Siaulys.&lt;/i&gt;&lt;/b&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-size: 14px; line-height: 21px; &quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;color: rgb(0, 0, 0); font-family: Verdana, Arial, sans-serif; font-size: 14px; line-height: 21px; &quot; /&gt;\r\n	&lt;br style=&quot;color: rgb(0, 0, 0); font-family: Verdana, Arial, sans-serif; font-size: 14px; line-height: 21px; &quot; /&gt;\r\n	&lt;span style=&quot;color: rgb(0, 0, 0); font-size: 14px; line-height: 21px; &quot;&gt;360 p&amp;aacute;ginas&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(196, 2, 'Ponto a Ponto', '', '', ''),
(199, 2, 'CD Baixa Visão na Infância', 'Baixa Visão na Infância', 'Baixa Visão na Infância', '&lt;p&gt;\r\n	&lt;i&gt;&lt;font size=&quot;3&quot;&gt;Manual B&amp;aacute;sico para Oftalmologistas&lt;/font&gt;&lt;/i&gt;&lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Subs&amp;iacute;dios ao atendimento da crian&amp;ccedil;a com baixa vis&amp;atilde;o, recursos para a avalia&amp;ccedil;&amp;atilde;o e aux&amp;iacute;lios especiais. &lt;br /&gt;\r\n	&lt;br /&gt;\r\n	Autores:&lt;br /&gt;\r\n	&lt;i&gt; &lt;b&gt; Maria Aparecidade Onuki Haddad&lt;br /&gt;\r\n	Marco Wilson Sampaio&lt;br /&gt;\r\n	Newton Kara-jos&amp;eacute;&lt;/b&gt;&lt;/i&gt;&lt;/p&gt;\r\n'),
(181, 2, 'Braillarina', '', '', '&lt;p style=&quot;text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;Caixa de papel&amp;atilde;o retangular, na cor vermelha, medindo 0,60 cm.X&amp;nbsp; 0,35 cm.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;Na parte da frente da caixa est&amp;aacute; colado o nome do brinquedo. Nas laterais da caixa &amp;agrave; direita e &amp;agrave; esquerda existem barreiras de 0,18 cm de altura onde foram feitos cortes que facilitam o transporte da caixa. Na frente e na parte posterior a barreira tem 0,13 cm de altura.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;A caixa possui 24 divis&amp;oacute;rias quadradas, cujos lados medem 0,7 cm.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;Em cada divis&amp;oacute;ria est&amp;aacute; fixada uma letra do alfabeto escrita em tinta, e uma cela onde est&amp;aacute; escrita esta mesma letra em braille.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;Cada divis&amp;oacute;ria cont&amp;eacute;m v&amp;aacute;rios brinquedos e objetos simples, pertencentes ao dia-a-dia da crian&amp;ccedil;a. Os nomes dos objetos colocados em cada divis&amp;oacute;ria iniciam com a letra a&amp;iacute; colocada.&lt;/span&gt;&lt;/p&gt;\r\n'),
(190, 2, 'Brinque Baby', '', '', '&lt;p style=&quot;text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;Objeto de forma circular, com um corte que o faz assemelhar-se a uma meia lua.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;Este objeto &amp;eacute; confeccionado com um pneu de bicicleta cortado, medindo de uma ponta a outra 1,80 cm. O pneu &amp;eacute; revestido com espuma, sendo maior a espessura na parte da frente, afinando nas duas pontas. Em seguida &amp;eacute; revestido de malha e recoberto de lycra azul.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;Na parte de maior espessura, ou seja, na frente, est&amp;atilde;o presos brinquedos t&amp;aacute;teis e sonoros, na ponta de el&amp;aacute;sticos que tem 15 cm de comprimento.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;Nas duas pontas s&amp;atilde;o presas fitas para ser dado um la&amp;ccedil;o, que fica nas costas da m&amp;atilde;e.&lt;/span&gt;&lt;/p&gt;\r\n'),
(178, 2, 'Arco-Íris', '', '', '&lt;p style=&quot;text-align: justify; &quot;&gt;\r\n	&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;Brinquedo em forma de meio arco, medindo 0,80 cm, na cor amarela.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;O objeto &amp;eacute; confeccionado com um tubo de poliotileno em cujo interior &amp;eacute; passada uma mangueira de buj&amp;atilde;o de g&amp;aacute;s.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;Este tubo &amp;eacute; revestido com tecido de malha e recoberto em seguida com tecido de pluma amarelo. Nas duas pontas o tubo &amp;eacute; fechado com tampas de PVC.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;Nas duas pontas do tubo s&amp;atilde;o presas fitas que servir&amp;atilde;o para fix&amp;aacute;-lo no carrinho ou no cadeir&amp;atilde;o.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif; text-align: justify; &quot;&gt;No tubo s&amp;atilde;o feitas 3 argolinhas onde se prendem com velcro tiras de tecido com 15 cm, na ponta das quais colocamos brinquedos sonoros e t&amp;aacute;teis.&lt;/span&gt;&lt;/p&gt;\r\n'),
(184, 2, 'Patinho Quen Quen', '', '', '&lt;p style=&quot;text-align: justify; &quot;&gt;\r\n	Brinquedo que tem a forma de um ovo, feito de tecido acoplado, na cor amarela, com 0,20 cm de altura. Possui uma abertura, no sentido da largura, fechada com z&amp;iacute;per, medindo 0,30 cm. Na parte interna o ovo &amp;eacute; forrado com tecido de nylon. Dentro encontra-se um patinho sonoro. &amp;nbsp;&lt;/p&gt;\r\n'),
(19, 2, 'Tapete de Estimulação Visual Colorido', '', '', '&lt;p style=&quot;text-align: justify&quot;&gt;\r\n	&lt;span style=&quot;font-family: tahoma, geneva, sans-serif&quot;&gt;Tapete quadrado medindo cada lado 1,0 metro, revestido de matelass&amp;ecirc;, cetim e gorgur&amp;atilde;o em uma das faces. &amp;Eacute; forrado com manta acr&amp;iacute;lica e na outra face com tecido de forro, preto e branco.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: tahoma, geneva, sans-serif&quot;&gt;Em uma face o tapete est&amp;aacute; dividido em 4 quadrados: um com fundo amarelo e 5 c&amp;iacute;rculos pretos; um com listas pretas e brancas; outro na cor laranja com um pequeno quadrado verde e o &amp;uacute;ltimo com fundo branco e losangos pretos.&lt;/span&gt;&lt;/p&gt;\r\n'),
(192, 2, 'Brailetras', '', '', '&lt;p style=&quot;text-align: justify; &quot;&gt;\r\n	Brinquedo composto de uma caixa quadrada medindo cada lado 0,35. No interior da caixa existem 30 divis&amp;oacute;rias quadradas, medindo cada lado 5 cm. Dentro de cada divis&amp;oacute;ria encontram-se 5 celas braille com 0,5 X 0,3 cm. Em uma divis&amp;oacute;ria na parte lateral &amp;agrave; direita, encontra-se um tubo de cola e um copo com bolinhas de EVA para serem colados nas celas afim de formar as letras braille. Na parte interna da tampa encontra-se um texto com a regra do brinquedo mostrando os objetivos a serem alcan&amp;ccedil;ados.&amp;nbsp;&lt;/p&gt;\r\n'),
(200, 2, 'Tapete de Alto Contraste', '', '', '&lt;p&gt;\r\n	Tapete de Alto Contraste&lt;/p&gt;\r\n'),
(203, 2, 'Kit Hora do Banho', '', '', '&lt;p&gt;\r\n	Kit Hora do Banho&lt;/p&gt;\r\n');

